	"323621FF0C01": "通风口内DVS的致动器（辅助系统）\\n“确定”按钮,在踩下制动踏板。",
	"323621FF0C02": "通风口内DVS的致动器（辅助系统）\\n等待,而其余时间为0秒,返回制动踏板。",
	"323621FF0C03": "通风口内DVS的致动器（辅助系统）\\n要返回制动踏板,按下“确定”按钮。",
	"323621FF0C04": "通风口内DVS的致动器（辅助系统）\\n已经完成（辅助系统）去除空气从DVS内的执行机构。\\n拧紧左前轮和右前轮的泄放塞。\\n（如果你继续不要求）\\n重复上述步骤空气,直到没有。 （大约5次）\\n按下按钮是,如果您重复该步骤。\\n按下按钮否,请继续执行步骤\\n按是或否按钮。",
	"323621FF0C05": "请检查以下的条件。\\n - 泄放插头紧密四轮收紧\\n - 在主缸储液罐的制动液不为空\\n\\n注意：\\n请勿移动DVS内执行器的车轮排气操作。",
	"323621FF0C0A": "残余次数",
	"323621FF0C0B": "2次系Repair of air",
	"323621FF0C0C": "执行ABS / VSC执行器的通风口时,此功能使用。\\n\\n应在下列情况下进行。\\n - 如果空气的污染可在ABS / VSC执行器内的电路加以考虑。\\n - 在制动管路中只排气运行的情况下通常不使用此功能。\\n\\n请参阅维修手册获取更多信息。",
	"323621FF0C0D": "请检查以下的条件。\\n\\n - 停止状态\\n - IG ON\\n - 未检测到故障诊断码\\n - 泄放插头紧密四轮收紧\\n - 在主缸储液罐的制动液不为空\\n\\n注意：\\n不要移动内部的ABS / VSC执行器的车轮排气操作。",
	"323621FF0C0E": "不要沮丧与196N的力{20kgf}比制动踏板等等。\\n它适用于ABS / VSC执行机构“确定”按钮,在此状态下按下大约10秒。",
	"323621FF0C10": "踩住制动踏板 10 秒。",
	"323621FF0C11": "请返回制动踏板。\\n\\n当您完成时,返回按钮,再次操作时,执行机构按退出按钮。",
	"323621FF0C12": "ABS排气",
	"323621FF0C13": "应在下列情况下执行的：ABS排空气。\\n - 如果空气的污染可以在ABS致动器的电路被认为是\\n - 在制动配管的唯一排气操作的情况下通常不使用该功能\\n\\n注意：\\n如果你想实现DVS的通风口通过按下结束按钮来结束一次,DVS气孔\\n请选择。",
	"323621FF0C19": "在通风口ABS执行器\\n检查以下条件。\\n - 泄放插头紧密四轮收紧\\n - 在主缸储液罐的制动液不为空\\n\\n注意：\\n不要移动内部的ABS执行器的车轮排气操作。",
	"323621FF0C1A": "在通风口ABS执行器\\n不要沮丧与196N {20kgf}力在制动踏板。\\n约10秒钟ABS执行器被激活“确定”按钮,在此状态下按下。",
	"323621FF0C1B": "我没能驱动器。\\n您确定要再次执行？",
	"323621FF0C1C": "在通风口ABS执行器\\n保持与196N {20kgf}的力量加强了制动踏板剩余时间为0秒。",
	"323621FF0C1D": "在通风口ABS执行器\\n要返回制动踏板,松开左前轮和右前轮的放气塞。\\n在下一屏或以后,我会做慢慢抽制动踏板。\\n（做10次的屏幕上的说明,即,放开4秒踏板踩下踏板4秒）",
	"323621FF0C1E": "在通风口ABS执行器\\n在这踩下制动踏板的状态",
	"323621FF0C1F": "在通风口ABS执行器\\n等待,而其余时间为0秒,返回制动踏板。",
	"323621FF0C20": "在通风口ABS执行器\\n要返回制动踏板,",
	"323621FF0C21": "在通风口ABS执行器\\n空气排气ABS执行器中完成。\\n拧紧左前轮和右前轮的泄放塞。\\n重复上述步骤空气,直到没有。 （大约5次）\\n按下按钮是,如果您重复该步骤。\\n你按下按钮否,请继续执行步骤\\n按是或否按钮。",
	"323621FF0C22": "请检查以下的条件。\\n - 泄放插头紧密四轮收紧\\n - 在主缸储液罐的制动液不为空\\n\\n注意：\\n不要移动内部的ABS执行器的车轮排气操作。",
	"323621FF0C23": "请勿操作制动踏板。\\n“确定”按钮,在此状态下按下它适用于大约13秒VSC执行机构。",
	"323621FF0C25": "直到剩余时间0秒、请保持制动原来状态并等待。",
	"323621FF0C26": "本功能用于查看异常工况记录。\\n按",
	"323621FF0C2E": "无记录",
	"323621FF0C2F": "有记录",
	"323621FF0C30": "清除特殊控制历史\\n失败。\\n请确认以下条件\\n- 点火开关在ON位置 \\n- Ready指示灯熄灭\\n是否重试？",
	"323621FF0C32": "是否清除全部历史？",
	"323621FF0C33": "无线诊断模式转换",
	"323621FF0C34": "此功能是用来确认符合以下条件。\\n - 无线/电子钥匙已经被注册\\n - 车辆正在接收无线/电子钥匙的无线电波",
	"323621FF0C35": "此功能是用来确认符合以下条件。\\n - 无线/电子钥匙已经被注册\\n - 车辆正在接收无线/电子钥匙的无线电波\\n选择你要迁移的条件,“确定”按钮。",
	"323621FF0C36": "CH1 / CH2 自动开关",
	"323621FF0C37": "CH1 固定",
	"323621FF0C38": "CH2 固定",
	"323621FF0C39": "参考以下信息。按下解锁按钮或无线/电子钥匙的锁,检查无线/电子钥匙的状态。\\n如果蜂鸣器鸣响定期：\\n - 无线/电子钥匙被登记\\n如果蜂鸣器持续鸣响：\\n - 无线/电子钥匙未注册\\n如果你不蜂鸣器响起：\\n - 有一种可能性,即车辆不能够接收在所述无线/电子钥匙的无线电波\\n - 您正在使用有可能不与车载无线/电子钥匙兼容",
