	"323621FF0D60": "请按照以下的顺序操作。\\n1. 挂挡杆 拨到S位置。\\n2. 齿轮1速的状态以5km/h-35km/h\\n5秒行走。\\n\\n Sequential M/T报警灯\\n1秒钟亮灯、\\n Sequential M/T学习完成。",
	"323621FF0D62": "删除CVT ECU的学习价值\\n检查以下条件。\\n - IG ON\\n - 发动机关闭\\n“确定”,然后按下按钮开始擦除的CVT ECU的学习价值。",
