	"323621FF0DA5": "这个功能,无线的主要目标\\n已注册或在车辆中,并且在车辆\\n它会检查是否正在接收无线钥匙的信号。\\n按下“确定”按钮。",
	"323621FF0DA6": "无线钥匙锁定按钮,\\n或按下解锁按钮,\\n蜂鸣器的声音从车辆所产生的图案\\n检查。\\n\\n（哔,哔,哔...）断断续续的声音\\n - 此无线钥匙是注册的。\\n连续的声音（P. ...）\\n - 此无线钥匙没有登记。\\n无蜂鸣声\\n - 车辆未接收到无线钥匙,或无线钥匙的信号\\n是不是与车辆兼容。",
