	"323621FF0DEF": "三级系统放气",
	"323621FF0DF0": "万顺昌执行器的通风口时,此功能使用。\\n\\n应在下列情况下进行。\\n-VSC如果空气的污染可在电路中的致动器加以考虑。\\n - 只有在制动管的排气操作的情况下,通常不使用此功能。\\n\\n请参阅维修手册获取更多信息。",
	"323621FF0DF1": "请检查以下的条件。\\n\\n - 停止状态\\n - IG ON\\n - 未检测到故障诊断码\\n - 的通风口位置以外泄放塞关紧\\n - 在主缸储液罐的制动液不为空\\n\\n注意：\\n请勿移动VSC内执行器的车轮排气操作。",
