	"323621FF0DFC": "通风口内DVS的致动器（辅助系统）\\n检查下列条件：\\n。 - 泄放插头紧密四轮收紧\\n - 在主缸储液罐的制动液不为空\\n\\n注意：\\n请勿移动DVS内执行器的车轮排气操作。",
	"323621FF0DFD": "通风口内DVS的致动器（辅助系统）\\n不要沮丧与196N {20kgf}力在制动踏板。\\n约10秒钟ABS执行器被激活“确定”按钮,在此状态下按下。",
	"323621FF0DFF": "通风口内DVS的致动器（辅助系统）\\n保持与196N {20kgf}的力量加强了制动踏板剩余时间为0秒。",
	"323621FF0E01": "此功能将进行以下操作。\\n\\n - 1行检测的2行检测诊断代码。\\n - 为了提高检测的诊断代码的灵敏度,使其更容易被检测到。\\n如果你想退出检查模式,IG关 - 请> IG ON。\\n\\n注意：\\n根据不同的车辆,以检查模式结束,\\n您可能需要保持20秒钟IG关状态。\\n按下“确定”按钮。",
