	"323621FF4B76": "执行后续操作:\\n- 按下刹车踏板并保持\\n- 松开排气阀塞子\\n- 按下“确定”\\n- 等待计时器",
	"323621FF4B77": "剩余时间:",
	"323621FF4B78": "关闭排气阀塞子,然后松开踏板.\\n\\n等待20秒.",
