	"323621FF4B7B": "退出排气功能?",
	"323621FF4B7C": "排气失败.\\n是否重试?",
	"323621FF4B7E": "欢迎使用“信号检查”工具。\\n该功能将设置所选系统的故障码。\\n如果确定操作条件正常,将会清除故障码。\\n注意：\\n- DLC3连接器端子TS在测试过程中接地。\\n- 关于所选系统的其他信息,请参考维修手册。\\n选择以下所需功能：\\n\\n检查全部信号",
	"323621FF4B80": "检查单个信号",
	"323621FF4B81": "检测到故障码。\\n进入“信号检查”时,故障码和冻结帧数据将被清除。\\n选择以下所需功能,然后按“确定”继续。\\n\\n退出并检查故障码\\n进入“信号检查”和“清除故障码”",
	"323621FF4B82": "退出并检查故障码",
	"323621FF4B83": "进入“信号检查”和“清除故障码”",
	"323621FF4B84": "请根据维修手册进行“信号检查”操作,然后按“确定”。",
	"323621FF4B86": "所有故障码、冻结帧数据和监测器状态都将被清除。\\n是否清除故障码？",
	"323621FF4B8A": "制动控制禁令",
	"323621FF4B8B": "ACCU稳压器O型向下驱动",
	"323621FF4B8C": "两个偏移学习",
	"323621FF4B8D": "压力释放",
	"323621FF4B8E": "学习",
	"323621FF4B91": "车速信号无效的历史",
	"323621FF4B94": "此功能会记住两个操作的参考位置。按“确定”按钮。",
	"323621FF4B95": "检查下列条件。\\n- 两个前端操作位置活动靠背扶手椅,有没有目标表的对象.\\n如果没有前端位置学习活动靠背扶手椅,两个经营活动靠背扶手椅格式化操作。\\n 移动到前面的位置,,然后按下“确定”按钮。开始位置记忆。",
	"323621FF4B96": "活动靠背扶手椅学习位置存储是完整的。",
	"323621FF4BA1": "<<:",
	"323621FF4BA2": ">>:",
	"323621FF4BA6": "【上下左右调节】\\n进行调节后\\n坐标的两条垂直线的目标输入会显示出来。\\n坐标的两条垂直线是否有新的数值输入？",
	"323621FF4BA7": "【上下左右调节】\\n进行上下左右调节。\\n操作“向上”或“向下”按钮\\n操作“向左”或“向右”按钮,\\n目标值将会在显示屏上显示出来。\\n请对移动调节。\\n\\n该调节仅一次。\\n按“向上”或“向下”按钮\\n按“向左”或“向右”按钮,\\n确认屏幕上已显示。",
	"323621FF4BA8": "【上下左右调节】\\n坐标两条水平线或者垂直线目标值\\n是否显示出来？",
	"323621FF4BA9": "【上下左右调节】\\n调节值记录后,重新建一个坐标。\\n目标值是否标记？",
	"323621FF4BAA": "【上下左右调节】\\n调节值记录后,重新建一个坐标。\\n目标值是否标记？\\n坐标两条水平线或者垂直线目标值\\n是否显示出来？",
	"323621FF4BAC": "是否结束微量喷射量详细学习？",
	"323621FF4BAE": "检查下列情况。\\n将发动机/电源开关转到ON(发动机OFF/Ready OFF)。\\n不要携带任何可能产生电波的设备(例如移动电源)进入车内。\\n务必在规定的时间内完成各个步骤。\\n不要携带两个或更多钥匙进入车内。否则可能导致功能执行失败。\\n检查并确认所有条件后按“确定”。",
	"323621FF4BAF": "是否退出钥匙码注册?",
	"323621FF4BB2": "进行下列步骤。\\n确保钥匙距离车辆30cm(厘米)或更远。\\n步骤1.准备好要注册的钥匙。\\n步骤2. 将要注册的钥匙放入车内。",
	"323621FF4BB5": "注册另一个钥匙。",
	"323621FF4BB7": "限时 30 秒",
	"323621FF4BB9": "钥匙码验证失败。\\n失败的原因可能有：\\n- 未注册的钥匙码。\\n- 钥匙已注册至另一车辆。\\n- 将发动机/电源开关转到OFF。\\n- 车辆蓄电池电压低。\\n- 车辆通信故障。\\n- 钥匙问题/蓄电池电压低。\\n- 车内有其它钥匙。\\n-电子干扰。\\n- 是否重试?",
	"323621FF4BBA": "在规定的时间限制内进行下列步骤。\\n将钥匙放在乘客座椅上。",
	"323621FF4BBB": "最后一个要注册的钥匙码注册失败。如果更换相应的智能ECU,则导致该钥匙不可用。先前匹配的所有钥匙码仍是已注册的。\\n按“确定”以注册另一个钥匙码,或按退出键退出本功能。",
	"323621FF4BBC": "如果要注册另一个钥匙,请进行下列步骤。\\n步骤1.将已注册的钥匙从车中拔出。\\n步骤2.将一把要注册的新钥匙放入车内。\\n步骤3. 用要注册的钥匙接触发动机开关(哔声)。\\n注册完成后,按'注册'按钮",
	"323621FF4BBD": "新钥匙可用位置:",
	"323621FF4BBE": "已注册钥匙数目:",
	"323621FF4BBF": "按“确定”以注册另一个钥匙码,或按退出键退出本功能。",
	"323621FF4BC0": "检查当前钥匙的数目,然后按“确定”继续。\\n如果有可用位置,仅新钥匙可注册。\\n如果新钥匙可用位置为 0,则不能注册新钥匙",
	"323621FF4BC3": "完成。\\n钥匙码注册完成。\\n务必检查并确认所有已注册钥匙可以使用。\\n如果注册钥匙不能使用,请参考修理手册。\\n按“确定”以注册另一个钥匙码,或按退出键退出本功能。",
	"323621FF4BC4": "准备好所有先前注册至旧ECU中的钥匙。\\n如果不能将所有钥匙准备好,则重新安装旧ECU,并执行钥匙码删除和钥匙注册功能。这样钥匙可以注册至新ECU。未准备使用本程序的钥匙不能注册至新ECU。\\n本功能如有任何将将导致钥匙不可用。\\n请进行随后画面上的步骤以将所有准备好的钥匙注册至新ECU。(确认所有准备好的钥匙工作正常,例如：按下钥匙上的按钮以确认LED灯亮起且车门正常打开。)\\n更换前注册至ECU的钥匙数目",
	"323621FF4BC5": "用已注册的钥匙接触发动机开关。",
	"323621FF4BC7": "在规定的时间限制内进行下列步骤。\\n将一把要注册的新钥匙放入车内。\\n用这把钥匙接触发动机开关(哔声)。",
	"323621FF4BC9": "已注册钥匙数目",
	"323621FF4BCB": "选项",
	"323621FF4BD0": "当前钥匙数目",
	"323621FF4BD3": "限时",
	"323621FF4BD4": "品牌",
	"323621FF4BDA": "钥匙码重置完成\\n请使用钥匙码注册工具注册钥匙。",
	"323621FF4BDB": "欢迎使用钥匙码重置工具。\\n这个功能将会擦除所有的钥匙码。\\n请先确认司机侧车门是打开状态。",
	"323621FF4BE0": "当前处于检查模式.",
	"323621FF4BE1": "车辆规格",
