	"323621FF4BEE": "准备好主钥匙。\\n在30秒内按下发射器上的一个开关。",
	"323621FF4BF0": "执行开关操作。\\n同时按下发射器上的上锁和开锁开关1秒,然后在3秒内再一次按下发射器任意一个开关1秒。",
	"323621FF4BF1": "正在登记",
	"323621FF4BF2": "剩余时间",
	"323621FF4BF3": "钥匙码登记完成\\n\\n按“确定”登记下另一把钥匙或者按'退出'来退出此功能",
	"323621FF4BF9": "正在删除,请等待",
	"323621FF4BFB": "是否退出钥匙码删除?",
	"323621FF4C00": "行李 + 行李",
	"323621FF4C01": "顶置 + 后门(车内)",
	"323621FF4C02": "顶置 + 后门",
	"323621FF4C03": "锁定器放大器",
	"323621FF4C04": "把钥匙靠近发射器和接收器.\\n如果无线蜂鸣器发声,通讯完好.\\n如果无线蜂鸣器静止,检查可能造成通讯故障的原因.\\n按下确定键显示可能原因.",
	"323621FF4C05": "<可能的原因>\\n\\n1.钥匙没有注册.\\n2.通讯失败.\\n按下确定键继续检查通讯或者 按下退出键退出.",
	"323621FF4C06": "没有可检测的项目!",
	"323621FF4C07": "选择项目",
	"323621FF4C08": "此功能用于删除ABS 电控单元记录数据.\\n\\n提示:如果更换了ABS 电控单元,或者重力& 横摆率传感器,可用此功能来重设ABS 电控单元的记录值.\\n\\n按下确定键继续.",
	"323621FF4C09": "检查初始条件,然后按下确定键.\\n\\n1.车辆停止.\\n2.点火开关打开.",
	"323621FF4C0A": "请进行以下操作。\\n1.将点火/发动机开关转到OFF。\\n2.请等待3秒。\\n3.将点火/发动机转到ON(发动机 OFF/Ready OFF).\\n记忆重设完成.\\n\\n按下回退键退出.",
	"323621FF4C0B": "此功能可以将诊断模式改为试验模式.\\n\\n提示:如果更换了ABS 电控单元,或者重力& 横摆率传感器,可用此功能来校准重力& 横摆率传感器的零点.\\n\\n按下确定键继续.",
	"323621FF4C0C": "检查初始条件,然后按下确定键.\\n\\n1.车辆停放在平地.\\n2.方向盘保持向前.\\n3.变速杆挂泊车挡.\\n4.引擎停转.\\n5.点火开关打开.",
	"323621FF4C0D": "操作如下,然后按下确定键.\\n\\n车辆保持静止状态至少2秒钟.",
	"323621FF4C0E": "ABS &车身稳定控制系统灯闪动,表明校准完成.\\n如果ABS &车身稳定控制系统灯不闪动,请再试一次.\\n\\n按下回退键退出.",
	"323621FF4C0F": "此功能用于进行空气排出。\\n\\n注意：\\n\\n·在对制动系统进行任何作业后,或者在怀疑制动器管线中有空气时,使用本功能排出系统中的空气。\\n\\n·在排出空气时,应使储液罐中的制动液液位保持在最高和最低刻度线之间。\\n\\n按【确定】继续。",
	"323621FF4C10": "增加管线\\n(右前/左前/右后/左后)\\n\\n1.把乙烯基排气管连接到四个排气阀塞子之一.\\n2.连踩几次刹车踏板,然后踩下踏板.\\n3.当刹车踏板踩下,松开排气阀塞子,通过连接管排出刹车油.\\n4.刹车油排放停止后,拧紧排放阀塞子,松开踏板.\\n\\n重复此过程,直到空气不再排出.\\n\\n当所有轮子都操作完成,按下确定键继续.",
	"323621FF4C11": "吸气管\\n(右前/右后)\\n\\n小心：排气时,确认刹车油高度不低于油箱的最低线.\\n\\n按下确定键继续.",
	"323621FF4C12": "吸气管\\n(右前/右后)\\n\\n把乙烯基管连接到右前轮或右后轮的排气阀塞子上,松开排气阀塞子.\\n\\n小心：在余下的进气过程中,不要踩下刹车踏板.\\n\\n按下确定键继续.",
	"323621FF4C13": "吸气管\\n(右前/右后)\\n\\n按下确定键,进行排气操作4秒.\\n注意:4秒后排气操作将关闭.",
	"323621FF4C14": "吸气管\\n(右前/右后)\\n\\n重复此操作,直到右前轮和右后轮刹车油中的空气都排出.\\n\\n按下是键重复此过程,或者按下否键退出.",
	"323621FF4C15": "减少管线\\n(右前/左前/右后/左后)\\n\\n小心:确认刹车油高度不低于油箱的最低线.\\n\\n按下确定键继续.",
	"323621FF4C16": "减少管线\\n(右前/左前/右后/左后)\\n\\n把乙烯基管连接到任一排气阀塞子上.\\n松开排气阀塞子.\\n\\n按下确定键继续.",
	"323621FF4C17": "减少管线\\n(右前/左前/右后/左后)\\n\\n小心:下一步要求压下刹车踏板并保持.\\n\\n在排气那4秒内不要松开踏板.\\n\\n按下确定键继续.",
	"323621FF4C18": "减少管线\\n(右前/左前/右后/左后)\\n\\n压下刹车踏板并保持,然后按下确定键来进行4秒排气.",
	"323621FF4C19": "减少管线\\n(右前/左前/右后/左后)\\n\\n重复此操作,直到右前轮和右后轮刹车油中的空气都排出.\\n\\n按下是键重复此过程,或者按下否键退出.",
	"323621FF4C1A": "增加管线\\n(右前/左前/右后/左后)\\n\\n1.把乙烯基排气管连接到四个排气阀塞子之一.\\n2.连踩几次刹车踏板,然后踩下踏板.\\n3.当刹车踏板踩下,松开排气阀塞子,通过连接管排出刹车油.\\n4.刹车油排放停止后,拧紧排放阀塞子,松开踏板.\\n\\n重复此过程,直到空气不再排出.\\n\\n当所有轮子都操作完成,按下确定键继续.",
	"323621FF4C1B": "空气排出已完成。",
	"323621FF4C1C": "拧紧排放阀塞子,然后松开踏板.\\n",
	"323621FF4C1D": "此功能用于禁止车身稳定控制系统和TRC 控制.\\n\\n提示:当车辆没有VSC 关闭开关时,可用此功能来禁止车身稳定控制系统和TRC 控制.\\n\\n按下“确定”键继续.",
	"323621FF4C1E": "检查初始条件,然后按下确定键.\\n\\n1.车辆处于泊车状态.\\n2.引擎运转.",
	"323621FF4C1F": "车身稳定控制系统和TRC 已被禁止.\\n\\n按照服务手册来检查操作.\\n\\n操作完毕后按下退出键退出.(车身稳定控制系统和TRC 控制重新有效)",
	"323621FF4C20": "不可用",
	"323621FF4C21": "选择所需的管线,然后按“确定”。",
	"323621FF4C22": "前右管线\\n\\n注意:4秒后下一屏幕中的排气操作将自动终止.\\n\\n按下“确定”键继续.",
	"323621FF4C23": "前右管线\\n\\n操作如下:\\n\\n1.松开排气阀塞子.\\n2.按下刹车踏板并保持.\\n3.按下“确定”键.\\n4.等待.",
	"323621FF4C24": "前左管线\\n\\n注意:The 4秒后下一屏幕中的排气操作将自动终止.\\n\\n按下“确定”键继续.",
	"323621FF4C25": "前左管线\\n\\n操作如下:\\n\\n1.松开排气阀塞子.\\n2.按下刹车踏板并保持.\\n3.按下“确定”键.\\n4.等待.",
	"323621FF4C26": "后右管线\\n\\n注意:4秒后下一屏幕中的排气操作将自动终止.\\n\\n按下确定键继续.",
	"323621FF4C27": "后右管线\\n\\n操作如下:\\n\\n1.松开排气阀塞子.\\n2.按下刹车踏板并保持.\\n3.按下“确定”键.\\n4.等待.",
	"323621FF4C28": "后左管线\\n\\n注意:4秒后下一屏幕中的排气操作将自动终止.\\n\\n按下“确定”键继续.",
	"323621FF4C29": "后左管线\\n\\n操作如下:\\n\\n1.松开排气阀塞子.\\n2.按下刹车踏板并保持.\\n3.按下“确定”键.\\n4.等待.",
	"323621FF4C2A": "关闭排气阀塞子,等待20秒.\\n",
