	"323621FF4C2C": "请 确认以下条件然后按下“确定”键.\\n\\n1.车辆停止.\\n2.驻车制动器启用.\\n3.点火开关打开.",
	"323621FF4C2D": "选择所需的管线,然后按“确定”。",
	"323621FF4C2E": "通常空气排放\\n前右管线\\n\\n操作如下,然后按下“确定”键.\\n\\n1.点火开关关闭.\\n2.根据维修手册移除相应的继电器或者拔掉连接器.\\n3.关闭点火开关.",
	"323621FF4C2F": "通常空气排放\\n前左管线\\n\\n操作如下,然后按下“确定”键.\\n\\n1.点火开关关闭.\\n2.根据维修手册移除相应的继电器或者拔掉连接器.\\n3.关闭点火开关.",
	"323621FF4C30": "通常空气排放\\n右后管线\\n\\n操作如下,然后按下“确定”键.\\n\\n1.点火开关关闭.\\n2.根据维修手册移除相应的继电器或者拔掉连接器.\\n3.关闭点火开关.",
	"323621FF4C31": "通常空气排放\\n左后管线\\n\\n操作如下,然后按下“确定”键.\\n\\n1.点火开关关闭.\\n2.根据维修手册移除相应的继电器或者拔掉连接器.\\n3.关闭点火开关.",
	"323621FF4C32": "通常空气排放\\n右前管线\\n\\n按以下四步操作.\\n\\n1.把乙烯基管连接到右前轮排气阀塞子上.\\n2.踩下刹车踏板,保持此状态然后松开排气阀塞子.\\n3.刹车油排放停止后,拧紧排放阀塞子,松开踏板.\\n4.重复此过程,直到空气不再排出.\\n\\n按下确定键继续.",
