	"323621FF4C40": "通常空气排放\\n全部管线\\n\\n按以下四步操作.\\n\\n1.把乙烯基管连接到右前轮排气阀塞子上.\\n2.踩下刹车踏板,保持此状态然后松开排气阀塞子.\\n3.刹车油排放停止后,拧紧排放阀塞子,松开踏板.\\n4.重复此过程,直到空气不再排出.\\n\\n按下确定键继续.",
	"323621FF4C41": "通常空气排放\\n全部管线\\n\\n按以下四步操作.\\n\\n1.把乙烯基管连接到左前轮排气阀塞子上.\\n2.踩下刹车踏板,保持此状态然后松开排气阀塞子.\\n3.刹车油排放停止后,拧紧排放阀塞子,松开踏板.\\n4.重复此过程,直到空气不再排出.\\n\\n按下确定键继续.",
	"323621FF4C42": "通常空气排放\\n全部管线\\n\\n按以下四步操作.\\n\\n1.把乙烯基管连接到左后轮排气阀塞子上.\\n2.踩下刹车踏板.\\n3.保持此状态然后松开左后轮排气阀塞子.\\n4.重复此过程,直到空气不再排出.\\n\\n按下确定键继续.",
	"323621FF4C43": "通常为所有管路排气需要以下4个步骤。\\n\\n1.将塑料软管连接至右后车辆的排气塞上。\\n2.松开制动踏板。\\n3.松开右后车轮的排气塞，压住制动踏板。\\n4.重复该过程直到不再有气体排出。\\n\\n按下“确定”继续。",
	"323621FF4C44": "通常空气排放\\n全部管线\\n\\n排气结束.\\n按下确定键返回排气主菜单,或者 按下退出键退出.",
	"323621FF4C45": "操作如下,然后按下确定键.\\n\\n1.点火开关关闭.\\n2.根据维修手册移除相应的继电器或者拔掉连接器.\\n3.关闭点火开关.",
	"323621FF4C46": "按以下四步操作.\\n\\n1.把乙烯基管连接到右前轮排气阀塞子上.\\n2.踩下刹车踏板,保持此状态然后松开排气阀塞子.\\n3.刹车油排放停止后,拧紧排放阀塞子,松开踏板.\\n4.重复此过程,直到空气不再排出.\\n\\n按下确定键继续.",
	"323621FF4C47": "按以下四步操作.\\n\\n1.把乙烯基管连接到左前轮排气阀塞子上.\\n2.踩下刹车踏板,保持此状态然后松开排气阀塞子.\\n3.刹车油排放停止后,拧紧排放阀塞子,松开踏板.\\n4.重复此过程,直到空气不再排出.\\n\\n按下确定键继续.",
	"323621FF4C48": "在下一屏幕,电磁阀(SLRFR,SLRFL,SLRRR,SLRRL) 激活.\\n激活电磁阀过程中,要在30秒内踩下刹车踏板 30 次.\\n\\n按下确定键继续.",
	"323621FF4C49": "操作如下,然后按下确定键.\\n\\n1.点火开关关闭.\\n2.根据维修手册安装相应的继电器或者拔掉连接器.\\n3.关闭点火开关.",
