	"323621FF4C4B": "按以下四步操作.\\n\\n1.把乙烯基管连接到右后轮排气阀塞子上.\\n2.踩下刹车踏板.\\n3.保持此状态然后松开右后轮排气阀塞子.\\n4.重复此过程,直到空气不再排出.\\n\\n按下确定键继续.",
	"323621FF4C4C": "松开左前轮的排气阀塞子.\\n在下一屏幕,电磁阀(SMC2 and SLAFL) 被激活.\\n此操作需要10秒.\\n注意:刹车油可能突然迸出.\\n\\n按下确定键继续.",
	"323621FF4C4D": "拧紧左前轮排气阀塞子,然后按下确定键.",
