	"323621FF4DAE": "本车的定制列表内没有历史记录!",
	"323621FF4DAF": "本功能用于 TOYOTA FREE-TRONIC 系统排放空气.\\n\\n注意:离合器工作缸和离合器驱动器组合后,必须进行空气排放.\\n\\n按下确定键继续.",
	"323621FF4DB0": "检查初始条件.\\n\\n1.车辆停止.\\n2.驾驶员一侧的门关闭.\\n(安全起见, 电控单元 的设计可以预防驾驶员一侧门打开情况下变速器动作.)\\n3.点火开关打开.\\n4.变速杆挂空挡.\\n\\n按下确定键继续.",
	"323621FF4DB1": "检查初始条件.\\n\\n1.刹车油充到储液池的上限.\\n2.排放阀开关关闭.\\n3.容器用管子收集刹车液.\\n4.行程传感器应以软布覆盖,以免接触到刹车油.\\n\\n按下确定键继续.",
	"323621FF4DB2": "更换部件完成.\\n\\n按下退出键退出.",
	"323621FF4DB3": "点火开关关闭,按下确定键.\\n\\n注意: 不要打开驾驶员一侧的门.",
	"323621FF4DB4": "更换部件完成.\\n\\n点火开关打开, 然后按下退出键退出.",
	"323621FF4DB5": "本功能用于对 TOYOTA FREE-TRONIC 系统加压.\\n\\n注意:更换离合器工作缸和离合器驱动器后,必须释放压力.\\n\\n按下确定键继续.",
	"323621FF4DB6": "转向角度调整失败。\\n检测到 C1515、C1516、C1532、C1568 以外的 DTC。\\n在进行转向角度调整前,对其进行诊断。",
	"323621FF4DB7": "本功能用于校准VGRS 系统.\\n\\n按下确定键继续.\\n\\n提示:使用此功能来使方向盘居中,如果:\\n\\n1.更换 VGRS 驱动器.\\n2.更换了VGRS 电控单元.\\n3.转向柱或转向齿轮断开.\\n4.方向轮偏离中心",
	"323621FF4DB8": "检查初始条件.然后按下确定.\\n\\n1.汽车停在水平平整的路面.\\n2.轮胎笔直朝前.\\n3.车辆停止.\\n4.引擎停转.\\n5.点火开关打开.",
	"323621FF4DB9": "按下确定键,断开方向盘和VGRS驱动器的连接.",
	"323621FF4DBA": "请把方向盘转到正中间.当方向盘转到正中间时按[确定]继续.",
	"323621FF4DBB": "进行如下操作,然后按下确定键.\\n\\n1.保持方向盘居中.\\n2.点火开关关闭.\\n3.等待3秒.\\n4.重新打开点火开关.\\n进行如下操作,然后按下确定键.",
	"323621FF4DBC": "轻微向右向左转动方向盘(5度左右),直到轮胎跟着转动.",
	"323621FF4DBD": "检查以下条件,然后按下确定键来校准 VGRS 系统.\\n\\n1.车辆停止.\\n2.引擎停转.\\n3.点火开关打开.\\n4.方向盘居中.",
	"323621FF4DBE": "转向角度调整失败。\\n检测到 DTC。\\n在进行转向角度调整前,对其进行诊断。",
	"323621FF4DBF": "转向角调整完成.\\n检查 VGRS 警告灯灭.\\n按下退出键退出.",
	"323621FF4DC0": "欢迎使用轮胎ID注册助手, 轻松把轮胎ID注册到电控单元中.\\n\\n注意: 如果操作超时,注册将失败.\\n按下“确定”继续.",
	"323621FF4DC1": "步骤1/4\\n\\n选择指定的轮胎型号,然后按下确定键.",
	"323621FF4DC2": "步骤2/4\\n\\n确认指定的轮胎型号,然后按下确定键",
	"323621FF4DC3": "步骤3/4\\n\\n按下确定键后进行如下操作.\\n\\n<操作>\\n每胎在15秒内增压或减压至少 20kPa(0.2kgf/cm2,2.9psi).",
	"323621FF4DC4": "没有动作测试 \\n本车的客户列表内!",
	"323621FF4DC5": "登录轮胎数：",
	"323621FF4DC6": "欢迎使用稳定器系统检测工具.\\n\\n本功能用于测试稳定器系统.\\n如果出现故障,将显示DTC码.\\n\\n按下确定键继续.",
	"323621FF4DC7": "确认以下条件:\\n\\n1.车辆静止.\\n2.引擎启动.\\n3.方向盘居中.\\n\\n按下确定键继续.",
	"323621FF4DC8": "操作如下.",
	"323621FF4DC9": "前轮扭角:",
	"323621FF4DCA": "后轮扭角:",
	"323621FF4DCB": "结束后按下确定键.",
	"323621FF4DCC": "1.向一方打方向盘至少90度 .",
	"323621FF4DCD": "2.把方向盘转回正中 .",
	"323621FF4DCE": "3.向另一方打方向盘至少90度.",
	"323621FF4DCF": "4.把方向盘转回正中.",
	"323621FF4DD0": "扭矩传感器调整失败。\\n检测到 DTC。\\n在进行扭矩传感器调整前,对其进行诊断。",
