	"323621FF4DD2": "步骤 2/2\\n",
	"323621FF4DD3": "欢迎使用无线代码清除助手.轻松清除所有无线代码,注册新代码.\\n\\n注意:如果超时,删除将失败.\\n\\n检查初始条件.\\n\\n1.点火开关打开.\\n2.驾驶员一侧的门打开.(其他车门关闭.)\\n3.驾驶员一侧的门未锁.(其他车门上锁.)",
	"323621FF4DD4": "步骤1/3\\n",
	"323621FF4DD5": "若干已登记的代码",
	"323621FF4DD6": "所有无线代码将被清除.注册新代码.\\n按下确定键继续.",
	"323621FF4DD7": "步骤2/3\\n\\n操作以下开关.\\n按下确定键30秒内进行操作.\\n<开关操作>\\n同时按下发射器的锁定和未锁开关1秒,然后再次在三秒内按下任一开关1秒.",
