	"323621FF4DD9": "无线代码清除完成.\\n\\n按下退出键退出",
	"323621FF4DDA": "欢迎使用无线代码注册助手.无线代码可以轻松注册到车门控制接收器.\\n\\n注意:如果超时,注册将失败.\\n\\n检查初始条件.\\n\\n1.点火开关打开.\\n2.驾驶员一侧的门打开.(其他车门关闭.)\\n3.驾驶员一侧的门未锁.(其他车门上锁.)",
	"323621FF4DDB": "若干可用于储存新密码的位置：",
	"323621FF4DDC": "无线代码注册完成.\\n注册表已经写满注册代码.\\n按下退出键退出",
	"323621FF4DDD": "无线代码注册完成.\\n按下确定键进行下一代码注册或者按下退出键退出",
