	"323621FF4DDF": "无线码登记失败。\\n登记寄存器现已存满所登记的密码。\\n如需登记新的密码,请使用无线码擦除功能来擦除现有的密码。",
	"323621FF4DE0": "欢迎使用门关初始工具.\\n\\n本功能用于初始化门关电控单元,当电控单元从通讯总线上永久断开时,将不会再发送DTC码.\\n\\n按下确定键继续.",
	"323621FF4DE1": "确认以下条件.\\n\\n1.车辆停止.\\n2.点火开关打开.\\n\\n按下确定键继续.",
	"323621FF4DE2": "门关电控单元并没有检测到任何通讯故障.\\n\\n按下确定键继续.",
	"323621FF4DE3": "操作如下.\\n- 把点火开关先关闭后打开.\\n\\n按下确定键继续.",
	"323621FF4DE4": "系统校准已完成。",
	"323621FF4DE5": "欢迎使用电控单元通讯ID注册助手,轻松在电控单元上注册一个通讯ID.\\n\\n检查以下条件,然后按下确定键.\\n\\n1.把一把注册过的主钥匙插入锁芯.\\n2.点火开关打开.",
	"323621FF4DE6": "步骤1/1\\n\\n从锁芯拔出主钥匙,然后插入,打开点火开关.\\n\\n按下确定键继续.",
	"323621FF4DE7": "电控单元通讯ID注册完成.\\n\\n按下退出键退出",
	"323621FF4DE8": "插入的钥匙不是已登记的主钥匙。\\n是否再次尝试？",
	"323621FF4DE9": "欢迎使用照相机角度调整工具.\\n\\n发生如下情况后,可用此功能调整监视器显示.\\n\\n1.更换夜视照相机.\\n2.更换夜视电控单元.\\n3.监视器显示改变.\\n\\n按下确定键继续.",
	"323621FF4DEA": "确认以下条件.\\n\\n1.点火开关打开.\\n2.夜视主开关关闭.\\n\\n按下确定键继续.",
	"323621FF4DEB": "移动显示上的十字来调整视角.\\n选择移动幅度.\\n按下确定键来选择幅度,如果位置正确,按下确定键来保存数据.",
