	"323621FF4E16": "该功能将会在发动机控制电脑中\\n注册喷油器修正编码。\\n\\n在以下情况中应该执行。\\n-更换喷油器\\n-更换喷油器ASSY\\n\\n按“确定”按钮",
	"323621FF4E17": "是否退出喷油器修正？",
	"323621FF4E18": "<注意>\\n当执行此功能时,\\n请务必参考维修手册。\\n\\n按“确定”按钮。",
	"323621FF4E19": "按“确定”按钮。\\n- 校正码注册\\n- 校正码读取\\n＜注意＞\\n当校正码注册/读取时\\n应该执行\\n“编码保存”或“编码确认”。",
	"323621FF4E1B": "纠错码注册",
	"323621FF4E21": "校正码注册\\n选择气缸,按“确定”按钮。\\n- 气缸1\\n- 气缸２\\n- 气缸３\\n- 气缸４",
