	"323621FF4E25": "喷油器修正已经结束。\\n如果要注册其他气缸,按“确定”按钮\\n如果要退出,按“确定”按钮。",
	"323621FF4E39": "该功能将执行G传感器0点学习。\\n应在下列情况下执行。\\n- 更换变速器装置或相关零件后\\n- 更换发动机控制电脑后\\n详细信息请参考维修手册。\\n按“确定”按钮。",
	"323621FF4E3A": "是否退出重力传感器0点学习？",
	"323621FF4E3B": "请检查以下条件。\\n- 操作位置水平\\n- 车辆自振动\\n- 变速杆位于P挡位置\\n- 停止状态\\n- 点火打开\\n- 发动机关闭\\n\\n按“确定”按钮开始学习。",
	"323621FF4E3D": "G传感器0点学习完成。",
	"323621FF4E3E": "该功能从转向控制\\n电脑与车辆配置的装备情况,\\n判断发动机控制电脑\\n车辆配置换挡控制同步。\\n应在下列情况下执行。\\n- 更换发动机控制电脑时\\n- 更换转向控制电脑时\\n详细信息,请参考维修手册。\\n\\n按“确定”按钮。",
	"323621FF4E3F": "是否退出换挡控制同步？",
	"323621FF4E40": "检查下列条件。\\n- 停止状态\\n- 点火打开\\n- 发动机关闭\\n- 换挡杆P挡位置\\n- 电池电压正常\\n\\n按“确定”按钮时,检查当前状态。",
	"323621FF4E41": "M模式\\n发动机控制电脑\\n已识别上述模式。\\n换挡杆和仪表显示以上模式\\n如果显示的模式是一致的,\\n不需要执行此功能。\\n按“退出”按钮\\n\\n不一致时,\\n按“确定”按钮。",
	"323621FF4E42": "换挡控制同步失败。\\n检查执行条件。\\n- 停止状态\\n- 点火打开\\n- 发动机关闭\\n- 换挡杆在P挡\\n- 电池电压正常\\n是否再次执行？",
	"323621FF4E43": "换挡控制同步完成。\\n发动机控制电脑\\n已识别上述模式。\\n\\n将换挡杆移动到S挡或M挡\\n换挡杆和仪表显示以上模式\\n请检查\\n显示的模式是否一致。\\n如果不一样,请参考维修手册\\n车辆处于行驶状态,应当重新进行。",
	"323621FF4E65": "该功能将启停/ECU启动和起动机启动次数进行初始化。\\n\\n应在下列情况下进行。\\n- 更换了起动机\\n\\n按“确定”按钮。",
	"323621FF4E66": "是否退出起动机启动次数初始化？",
	"323621FF4E67": "检查下列条件。\\n- 点火打开\\n- 电池电压高于8 V",
	"323621FF4E68": "初始化起动机的启动次数。\\n按“确定”按钮。",
	"323621FF4E69": "启动次数初始化完成。",
	"323621FF4E6A": "该功能将启停/ECU启动,\\n是否配备空调的信息进行初始化。\\n\\n按“确定”按钮。",
	"323621FF4E6B": "是否退出空调信息初始化？",
	"323621FF4E6C": "检查下列条件\\n- 点火打开\\n- 启停/ECU启动\\n未检测到诊断故障码U0100",
	"323621FF4E6D": "空调信息初始化完成。",
	"323621FF4E6E": "加速传感器零点校正\\n该功能是一个加速传感器零点校正\\n的功能。\\n\\n按“确定”按钮。",
	"323621FF4E6F": "是否退出加速传感器零点校正？",
	"323621FF4E70": "检查下列条件\\n- 点火打开\\n- 发动机停止\\n- 车辆停止\\n- 处于无振动状态\\n- 变速杆在P挡（AT）\\n- 变速杆在空挡（MT）\\n- 行李箱是空的\\n- 在水平地面上执行\\n- 未踩下加速踏板\\n- 未踩下制动踏板\\n按“确定”开关。",
	"323621FF4E71": "加速传感器零点校正完成",
