	"323621FF4E76": "是否退出电流累计值初始化？",
	"323621FF4E77": "电流累计值初始化完成。",
	"323621FF4E81": "\\n此功能将进行CVT液压泵通风。\\n\\n- 应在下列情况下进行。\\n- 更换了CVT液压泵\\n\\n检查以下条件。\\n- 停止状态\\n- 点火打开\\n- 发动机停止",
	"323621FF4E82": "是否退出CVT液压泵通风？",
	"323621FF4E83": "CVT液压泵通风完成。",
	"323621FF4E84": "该功能将执行以下操作。\\n- 在1个行程检测2个行程的故障码。\\n- 已增加检测诊断故障码的灵敏度,使其更容易检测。\\n\\n要退出检查模式,请执行点火关闭-->点火打开。\\n注意：根据车辆的不同,检查模式结束时,\\n需要在20秒内保持点火关闭状态。\\n\\n按“确定”按钮",
	"323621FF4E85": "转换至检查模式失败。\\n检查执行条件。\\n- 点火打开\\n- 发动机关闭\\n是否再次执行？",
	"323621FF4E86": "检测到诊断故障码。\\n当转换到检查模式时,诊断故障码和冻结帧数据等诊断信息将被全部清除。\\n选择要执行的项目程序,按“确定”按钮。",
	"323621FF4E87": "转换到检查模式（清除诊断故障码）",
	"323621FF4E88": "\\n该功能将会初始化启停起动机ECU的启动次数\\n\\n检查以下条件。\\n- 更换起动机时\\n按“确定”按钮。",
	"323621FF4E89": "是否确定退出起动机启动次数初始化？",
	"323621FF4E8A": "检查以下条件。\\n- 打开点火\\n- 电池电压大于8V",
	"323621FF4E8B": "初始化起动机启动次数。\\n按“确定”按钮。",
	"323621FF4E8C": "起动机启动次数初始化已完成。",
	"323621FF4E8D": "启停功能/开始当前规定\\n当前ECU信息包含新的启停功能/将启停写入ECU。\\n\\n- 应该在以下情况下进行。\\n- 车辆启停时/开始ECU更换\\n\\n\\n请按“确定”按钮。",
	"323621FF4E8E": "是否确定退出起动机启动次数设置？",
	"323621FF4E8F": "检查以下条件。\\n- 停止状态\\n- 打开点火\\n- 电池电压大于8V",
	"323621FF4E90": "启停/开始ECU更换,\\n同时执行以下程序。\\n\\n步骤1.启停/启动ECU\\n移除之前,选择“步骤1下载”,\\n启停/启动当前ECU信息\\n完成下载。\\n步骤2.启停/根据维修手册进行操作\\n更换ECU。\\n步骤3.启停/更换前启动ECU\\n信息,选择“步骤3上传”\\n完成上传。",
	"323621FF4E91": "选择需要进行的操作,\\n请按“确定”按钮。\\n\\n步骤1下载\\n（在更换前先读取ECU信息）\\n\\n步骤3上传\\n（把之前从ECU读取的信息写入新的ECU）",
	"323621FF4E92": "步骤1下载（在更换前先读取ECU信息）",
	"323621FF4E93": "步骤3上传（把之前从ECU读取的信息写入新的ECU）",
	"323621FF4E94": "在启停之前/开始ECU更换\\n无法下载信息。\\n请执行确认条件。\\n- 停止状态\\n- 打开点火\\n- 电池电压大于8V\\n是否要再次执行",
	"323621FF4E95": "步骤1下载\\n启停/启动当前ECU信息\\n并保存。\\n按照维修手册,继续进行步骤2\\n启停/更换后启动ECU\\n继续到步骤3。",
	"323621FF4E96": "步骤3上传\\n起动机启动次数设置已完成。",
	"323621FF4E97": "CVT液压泵通风\\n将执行该功能。\\n\\n- 需要在以下情况下才能执行该功能。\\n- 更换CVT液压泵时\\n\\n请检查以下条件。\\n- 打开点火\\n- 关闭发动机\\n按“确定”按钮。",
	"323621FF4E98": "CVT液压泵通风\\n是否想要结束？",
	"323621FF4E99": "CVT液压泵通风已经结束。",
	"323621FF4E9A": "该功能需要安装维修手册说明\\n才能执行。\\nB1活塞驱动力\\nB1空气室无法排气。\\n\\n请按“确定”按钮。",
	"323621FF4E9B": "是否确定要退出B1空气室？",
	"323621FF4E9C": "检查以下条件。\\n- 准备开启\\n- 变速器驻车挡\\n- 停止状态及加速踏板\\n未踩下。\\n- 混合动力车辆控制器电脑开启\\n未检测出相关的诊断故障码\\n- 变速器机油温度正常\\n- 空调关闭\\n请按“确定”按钮。",
	"323621FF4E9D": "\\n请等待直到B1活塞驱动164次。",
	"323621FF4E9E": "在排气中",
	"323621FF4E9F": "驱动次数：",
	"323621FF4EA0": "倍",
	"323621FF4EA1": "B1空气室无法排气。\\n请检查各设备条件。\\n- 准备开启\\n- 变速器驻车挡\\n- 停止状态及加速踏板\\n未踩下。\\n- 混合动力车辆控制器电脑开启\\n未检测出相关的诊断故障码\\n- 变速器机油温度正常\\n- 空调关闭\\n\\n是否要再次执行？",
	"323621FF4EA2": "B1空气室已完成排气。",
	"323621FF4EA3": "该功能将执行到维护模式的转换。\\n\\n注意：\\n操作完成,退出维护模式\\n请确定关闭点火。\\n\\n请按“确定”按钮。",
	"323621FF4EA4": "是否确定要退出维护模式？",
	"323621FF4EA5": "检查以下条件。\\n- 将换挡杆置于驻车挡\\n- 打开点火\\n- 准备关闭\\n- HV相关的诊断故障码\\n未检测出\\n\\n- 请按“确定”按钮。",
	"323621FF4EA6": "选择并转换到维护模式,\\n请按“确定”按钮。",
