	"323621FF4EAE": "检查以下条件。\\n- 将换挡杆置于驻车挡\\n- 打开点火\\n- 准备关闭\\n- HV相关的诊断故障码\\n未检测出\\n\\n- 请按“确定”按钮。",
	"323621FF4EAF": "选择并转换到维护模式,\\n请按“确定”按钮。",
