	"323621FF4EF6": "该功能会禁止VSC/TRC操作。\\n\\n注意：\\n只有在VSC开关无法关闭时\\n选择需要进行的操作。\\n\\n请按“确定”按钮。",
	"323621FF4EF8": "检查以下条件。\\n- 将换挡杆置于驻车挡\\n- 打开点火\\n- 打开发动机\\n请按“确定”按钮。",
	"323621FF4EF9": "禁止VSC/TRC操作。\\n请根据维修手册进行保养。\\n关闭点火-->打开点火时,\\nVSC/TRC操作禁用。",
	"323621FF4EFA": "\\n该功能将进行偏航率-加速度传感器零位清除。\\n\\n该操作应在以下情况下进行。\\n- 防滑控制器电脑更换\\n- 偏航率传感器/加速度传感器更换\\n\\n请按“确定”按钮。",
	"323621FF4EFC": "检查以下条件。\\n-工作场地水平\\n-方向盘在中间位置\\n-换挡杆在P挡\\n- 停车状态\\n- 打开点火\\n-发动机关闭\\n请按“确定”按钮。",
	"323621FF4EFD": "让车辆静止4秒钟。\\n按“确定”按钮。",
	"323621FF4EFE": "ABS学习指示灯闪烁\\n偏航率-加速度传感器零位清除已完成。\\n如要使指示灯停止闪烁,需要再进行一次操作。",
	"323621FF4EFF": "\\n该功能将进行以下操作支持电子控制制动。\\n请选择需要进行的操作\\n\\n- 制动控制禁止\\n- 蓄能器减压驱动\\n- 线性阀偏移学习",
	"323621FF4F00": "转矩传感器调整失败.\\n确认如下条件.\\n按照屏幕指示来回扳动点火开关.\\n再试一次?",
