	"323621FF4F4C": "欢迎使用门关初始化工具.\\n\\n从通讯总线上卸除一个电控单元后,此功能用于初始化门关电控单元,让它不要持续生成故障码.\\n\\n注意:此工具将清除所有的门关电控单元故障码.\\n\\n按下确定键继续.",
	"323621FF4F4D": "确认以下条件.\\n\\n1.车辆静止.\\n2.点火开关打开.\\n\\n按下“确定”键继续.",
	"323621FF4F4E": "现在门关电控单元不会检测任何通讯故障.\\n\\n按下“确定”键继续.",
	"323621FF4F4F": "按下确定键开始初始化.\\n\\n注意:\\n如果继续,门关电控单元中存储的故障码将被清除.",
	"323621FF4F50": "小心\\n\\n初始化一旦完成,产生通讯故障码的电控单元将不能接通,即使它仍然保持连接.\\n\\n按下确定键开始初始化.",
	"323621FF4F51": "操作如下.\\n\\n把点火开关先关闭后打开.\\n\\n按下“确定”键继续.",
	"323621FF4F52": "系统校准已完成。",
	"323621FF4F53": "高度传感器初始化",
	"323621FF4F54": "高度传感器初始化出错",
	"323621FF4F55": "欢迎进入高度传感器初始化向导.\\n\\n此功能用来初始化高度传感器.\\n\\n按“确定”键继续.",
	"323621FF4F56": "确认以下条件.\\n\\n1.引擎开关/电源开关打开.\\n2.引擎停转.\\n3.乘客舱空.\\n4.行李箱空.(备胎和其他车用工具除外.)\\n5.车辆停放在平面上.\\n6.高度传感器连接.\\n\\n按下确定键继续.",
	"323621FF4F57": "高度传感器初始化失败.\\n请确认以下条件:\\n\\n1.引擎开关/电源开关打开.\\n2.引擎停转.\\n3.乘客舱空.\\n4.行李箱空.(备胎和其他车用工具除外.)\\n5.车辆停放在平面上.\\n6.高度传感器连接.\\n\\n关闭打开引擎开关/电源开关,然后再试一次.\\n再试一次?",
	"323621FF4F58": "高度传感器初始化完成.",
	"323621FF4F59": "更换启动机",
	"323621FF4F5A": "出错起动机更换",
	"323621FF4F5B": "此功能用于清除启停电控单元中存储的启动器操作码.\\n\\n提示:更换启动器后必须启用此功能.\\n\\n按下“确定”键继续.",
	"323621FF4F5C": "检查初始条件,然后按下“确定”键.\\n\\n1.点火开关打开.\\n2.电池电压至少8V.",
	"323621FF4F5D": "启动器更换 失败.\\n确认初始条件:\\n\\n1.点火开关打开.\\n2.电池电压至少8V.\\n再试一次?",
	"323621FF4F5E": "启动器更换 完成.\\n按下退出键退出.",
	"323621FF4F5F": "重设空调信息",
	"323621FF4F60": "重设空调信息错误",
	"323621FF4F61": "欢迎使用重设空调信息工具.\\n\\n此功能用于重设启停电控单元中的空调信息,车辆有无安装空调电控单元都可.\\n\\n按下“确定”键继续.",
	"323621FF4F62": "确认以下条件.\\n\\n1.点火开关打开.\\n2.车辆静止.\\n3.没显示DTC U0100 .\\n\\n按下“确定”键继续.",
	"323621FF4F63": "重设空调信息 失败.\\n\\n再试一次?",
	"323621FF4F64": "重设空调信息 完成.",
	"323621FF4F65": "按下确定键 清除启动器操作号.",
	"323621FF4F66": "激光/雷达 巡航初始化",
	"323621FF4F67": "激光/雷达巡航初始化错误",
	"323621FF4F68": "欢迎使用 激光/雷达巡航初始化工具.\\n\\n此功能用于初始化巡航电控单元 .\\n\\n按下“确定”键继续.",
	"323621FF4F69": "确认以下条件:\\n\\n1.The 点火开关打开.\\n2.电池电压至少8V.\\n\\n按下确定键继续.",
	"323621FF4F6A": "激光/雷达巡航初始化失败.\\n确认以下条件:\\n\\n1. 点火开关打开.\\n2.电池电压至少8V.\\n\\n再试一次?",
	"323621FF4F6B": "激光/雷达巡航初始化已完成。",
	"323621FF4F6C": "欢迎使用应答器编码删除助手.\\n此功能将删除所有匹配的防盗钥匙,除了正在使用的这把.\\n\\n注意: 如果任一步骤操作超时,应答器编码删除将失败 .\\n\\n按下确定键继续.",
	"323621FF4F6D": "步骤1/2\\n\\n在120秒内进行如下操作,然后按下确定键.\\n1.把钥匙从锁芯拔出.\\n2.往锁芯插入一把匹配过的主钥匙.\\n3.打开点火开关.",
	"323621FF4F6E": "应答器编码清除失败.\\n在钥匙和转向锁ECU/应答器钥匙ECU总成之间出现通讯错误.\\n是否重试?",
	"323621FF4F6F": "电控单元准备进入自动注册模式,此操作无需注册钥匙,关于手动注册步骤请参考保养信息",
	"323621FF4F70": "操作如下.然后按下确定键.\\n\\n1.关闭点火开关.\\n2.等3秒钟.\\n3.再次打开点火开关.\\n4.然后按下“确定”键.",
	"323621FF4F75": "确认PS警告灯亮.\\n按下“确定”键继续.",
	"323621FF4F76": "操作如下,然后按下确定键.\\n\\n1.设置方向盘居中.\\n2.向任一方向转动方向盘超过45度.\\n3.把方向盘转回居中.\\n4.向另一方向转动方向盘超过45度.\\n5.把方向盘转回居中.",
	"323621FF4F77": "现在开始校准\\n",
	"323621FF4F78": "出错扭力传感器调整",
	"323621FF4F79": "扭矩传感器调整失败。\\n发生了通信错误。",
	"323621FF4F7A": "转矩传感器调整失败.\\nDTC C1525/C1526 出现.\\n在进行转矩传感器调整前,诊断并清除其他DTC码.",
	"323621FF4F7B": "转矩传感器调整失败.\\nDTC C1581 出现.\\n在进行转矩传感器调整前,诊断并清除其他DTC码.",
	"323621FF4F7C": "转矩传感器调整失败.\\nDTCs 出现.\\n在进行转矩传感器调整前,诊断并清除其他DTC码.",
	"323621FF4F7D": "确认方向盘居中.\\n\\n注意: 在下一步中,方向盘 会震动.\\n振动时不要碰触方向盘.\\n\\n按下“确定”键继续.",
	"323621FF4F7E": "震动结束后按下“确定”键 .",
	"323621FF4F7F": "扭矩传感器调整完成。",
	"323621FF4F80": "转矩传感器调整 失败.\\n C1515/C1525/C1581之外的故障码 出现.\\n在进转矩传感器调整前,诊断和清除其他的DTC.",
	"323621FF4F82": "请 确认以下条件:\\n1.车辆停止.\\n2.点火开关打开.",
	"323621FF4F83": "点火开关先关闭后打开(就绪),然后按下“确定”键.",
	"323621FF4F87": "校准失败.\\n按下“确定”键 再试一次.",
	"323621FF4F88": "转矩传感器调整 失败.\\n通讯错误.",
	"323621FF4F89": "欢迎使用转矩传感器调整助手.\\n\\n此功能用于保持方向盘居中,如果:\\n1. 更换EPS 电控单元 .\\n2. 更换转向齿轮总成.\\n3.转左或转右时,转动力有差别.\\n\\n按下“确定”键继续.",
	"323621FF4F8A": "确认方向盘居中.\\n\\n注意: 系统校准时不要碰方向盘 .",
	"323621FF4F8B": "在初始化模式时,ID 注册失败,和电控单元通讯出现错误.\\n\\n要终止初始化过程,在30秒内连接DLC3的 TC 和CG.\\n\\n然后尝试再次进行注册 .",
	"323621FF4F8C": "int y;BYTE x;if(x>0X7f)y=x-256;else if(x<0x80)y=x;",
	"323621FF4F8D": "车辆识别码(VIN)",
