	"323621FF4F91": "车辆识别码(VIN)写入",
	"323621FF4F92": "欢迎访问汽车识别码(VIN)实用程序。\\n该功能主要将VIN输入ECM中。\\n选择需要的功能,并按确定键选定。",
	"323621FF4F93": "ECM/PCM对VIN读取功能无响应。\\n可能原因：\\n1.VIN从未被写入。\\n2.ECM/PCM不支持此功能(只针对05年及之后的车型)。",
	"323621FF4F94": "该功能在完成VIN写入后自动擦除故障码。\\n检查下列条件,并按确定键继续。\\n1.发动机熄火/预备熄火。\\n2.点火钥匙处于ON位置。\\n注意：对于混合动力车型,此时点火钥匙必须处于ON的位置,且车辆必须处于预备关闭模式。",
