	"323621FF4F9D": "伺服电机初始化",
	"323621FF4F9E": "欢迎来到空调伺服电机初始化安装向导。\\n该功能用于空调伺服电机的初始化。\\n\\n在下列情况下使用该使用程序：\\n1.更换了伺服电机ECU。\\n2.更换了空调放大器。\\n3.断开了电源。\\n按确定键继续。",
	"323621FF4F9F": "确认下列条件：\\n\\n1.打开了点火。\\n2.关闭了空调。\\n按确定键继续。",
	"323621FF4FA0": "伺服电机初始化错误",
	"323621FF4FA1": "初始化失败。\\n验证下列条件：\\n1.启动开关按钮打开ON(点火)。\\n2.空调关闭。(按关闭开关)\\n是否重试？",
	"323621FF4FA2": "正在初始化。\\n当DEF指示器停止闪烁,或AUTO指示器关闭后,初始化完成 。",
	"323621FF4FA3": "欢迎来到A/T码复位程序。\\n\\n该功能用于在更换了阀门体或总成后,复位补偿码,并初始化ECT ECU。\\n\\n按确定键继续。",
	"323621FF4FA4": "必须在查阅了保养手册后再执行该功能。\\n\\n确认下列条件：\\n1.挡位选择杆处于驻车位置。\\n2.车辆已停止。\\n3.发动机熄火。\\n4.点火打开。\\n\\n按确定键继续。",
	"323621FF4FA5": "A/T码复位已完成。",
	"323621FF4FA6": "欢迎来到检查模式程序。\\n\\n该功能用于切换到检查模式。\\n注意：完成该功能后,关闭点火钥匙退出该模式。\\n\\n按确定键继续。",
	"323621FF4FA7": "确认下列条件：\\n1.点火钥匙开关打开。\\n2.预备指示灯I关闭。\\n3.未出现混合动力车辆ECU相关的故障码。\\n\\n按确定键继续。",
	"323621FF4FA8": "已完成到检查模式的切换。\\n将预备按钮打开。\\n\\n注：按确定键切入至检查模式。\\n按确定键后,将点火钥匙打向OFF位。",
	"323621FF4FA9": "此时应预存该信息。\\n预存名为:气缸5",
	"323621FF4FAA": "此时应预存该信息。\\n预存名为:气缸6",
	"323621FF4FAB": "此时应预存该信息。\\n预存名为:气缸7",
	"323621FF4FAC": "此时应预存该信息。\\n预存名为:气缸8",
	"323621FF4FAD": "欢迎来到引燃油量识别值复位程序。\\n该程序主要用于复位引燃油量的识别值。\\n确认下列条件：\\n1.点火钥匙开关ON\\n2.发动机熄火。\\n按确定键继续。",
	"323621FF4FAE": "引燃油量识别值复位已完成",
	"323621FF4FAF": "欢迎来到空燃比传感器补偿复位实用程序。\\n该功能用于复位氧传感器补偿的识别值。\\n在更换了空燃比传感器后执行该功能。\\n确认下列条件：\\n1.点火钥匙ON。\\n2.发动机熄火。\\n按确定键继续。",
	"323621FF4FB0": "氧传感器补偿复位已完成",
	"323621FF4FB1": "欢迎来到摇动时间补偿复位实用程序。\\n该功能用于复位摇动时间补偿的识别值。\\n在更换了发动机总成后执行该功能。\\n确认下列条件：\\n1.点火钥匙ON。\\n2.发动机熄火。\\n按确定键继续。",
	"323621FF4FB2": "摇动时间补偿复位已完成",
	"323621FF4FB3": "该功能用于在更换了催化剂后,清除ECU中的DPNR热降解的催化剂记录。",
	"323621FF4FB4": "催化剂记录清除已完成。",
	"323621FF4FB5": "欢迎来到柴油颗粒过滤器(DPF）记录清除的实用程序。\\n该功能用于清除DPF的恶化记录。\\n在更换了DPF后执行该功能。\\n确认下列条件：\\n1.点火开关ON。\\n2.发动机熄火。\\n按确定键继续。",
	"323621FF4FB6": "柴油颗粒过滤器(DPF）恶化记录清除已完成。",
	"323621FF4FB7": "欢迎进入防盗器代码重置应用程序.\\n\\n此程序将清除所有注册的防盗器钥匙.\\n\\n请确认以下条件;\\n- 一个万能钥匙插在锁芯中.\\n- 点火打开.\\n- 驾驶员车门打开.\\n\\n按确定键继续.",
	"323621FF4FB8": "重置完成",
	"323621FF4FB9": "<使用>\\n如果丢失了所有的钥匙,可以使用此功能来清除所有的应答器编码.\\n\\n<说明>\\n此功能清除所有注册的应答器编码和将ECU模式转变为自动注册模式.您需要一个密码才能执行此功能.详情请参照维修手册和服务通告.密码是713254",
	"323621FF4FBA": "欢迎进入钥匙代码注册导向,轻松注册钥匙代码到ECU.\\n注意: 如果各步骤操作超时,则注册会失败.\\n<注意>\\n1.电源/E发动机开关打开(点火).\\n2.关掉所有驾驶员座椅附近的手机.检查以下情况,再按确定键.",
	"323621FF4FBB": "注册了错误的钥匙代码",
	"323621FF4FBC": "钥匙代码注册失败.\\n额外代码的存储空间已满.\\n如果您想注册新的代码,请使用钥匙代码清除功能清除代码.",
	"323621FF4FBD": "钥匙代码注册失败.\\n请检查是否有以下情况.\\n检查以下情况:\\n1.您的钥匙代码不是注册的钥匙代码.\\n2.电源/发动机开关关闭.\\n3.通信失败.\\n再试一次吗?",
	"323621FF4FBE": "<注意>\\n在替换的ECU里确认所有的钥匙都已注册.\\n\\n在将钥匙代码注册到一个新的ECU时请一个一个地确认所有的钥匙.",
	"323621FF4FBF": "当前选择车辆不配备防抱死制动系统和安全气囊系统",
	"323621FF4FC0": "拆下控制计算机主电源保险丝或电瓶负极线30秒即可清除故障码。",
	"323621FF4FC1": "正在清除安全气囊系统的故障码...\\n请注意:\\n数秒钟后,安全气囊系统的警告灯会快速闪烁,表示安全气囊系统的故障码已清除,此时点火钥匙关即完成清除。",
	"323621FF4FC2": "故障码已清除",
	"323621FF4FC3": "17PIN半圆形诊断座",
	"323621FF4FC4": "17PIN方形或者22PIN诊断座",
