	"323621FF4FCC": "按“确定”按钮。",
	"323621FF4FD0": "检查模式",
	"323621FF4FD1": "该功能将执行以下操作。\\n- 在1个行程检测2个行程的故障码。\\n- 增加检测诊断故障码的灵敏度,使其更容易检测。\\n\\n要退出检查模式,请执行点火关闭-->点火打开。\\n注意：根据车辆的不同,检查模式结束时,\\n需要在20秒内保持点火关闭状态。\\n\\n按“确定”按钮",
	"323621FF4FD2": "检查转换模式失败。\\n检查执行条件。\\n- 点火打开\\n- 发动机关闭\\n是否再次执行？",
	"323621FF4FD3": "检测到诊断故障码。\\n当转换到检查模式时,诊断故障码和冻结帧数据等诊断信息将被全部清除。\\n选择程序项目,按“确定”按钮。",
	"323621FF4FD4": "退出（诊断码确认）",
