	"326021FE4FAB": "本主动测试切断所有气缸的燃油和点火,且发动机运转大约 10 秒。然后,在每个气缸测量发动机转速。如果某个气缸的发动机转速高于其他,则进行比较确定该气缸的压缩压力是否低于其他气缸。\\n\\n\\n监控测试仪上显示的发动机转速（1 号至 * 号气缸的发动机转速、所有气缸的平均发动机转速）。",
