	"326021FE4FBF": "本测试最多需要 60 秒激活空气泵加热器。\\n为保护空气泵加热器,不要连续执行本测试超过 4 次。在 IG ON、发动机 OFF 和选挡杆位于 P 的情况下执行本测试。\\n\\n\\n注：如果空气泵温度过高,则无法正确执行主动测试。请在空气泵冷却后启动主动测试。在主动测试过程中正确控制 AI 加热器温度,以确保执行前发动机冷却。",
