	"326021FE4FC1": "进气温度必须高于 41°F（5°C）且进气温度传感器正常。",
	"326021FE4FC2": "在 IG ON、发动机 ON 且处于工作温度的情况下操作。选挡杆必须位于 P 或 N。",
