	"326021FE4FC6": "在发动机暖机和怠速的情况下操作。\\n排气管周围不得遗留任何可燃性物品。\\n操作过程中,发动机转速将提高并且施加排气制动器。",
	"326021FE4FC7": "在车速不低于 60 km/h（36 MPH）的情况下操作。",
	"326021FE4FC8": "[AT]\\n在车速不高于 30 MPH（50 km/h）的情况下操作。\\n\\n\\n[CVT]\\n在车速处于 20 km/h（10.8 MPH）和 45 km/h（24.3 MPH）范围内的情况下操作。",
	"326021FE4FC9": "在 IG ON、发动机 OFF 和选挡杆位于 P 或 N 的情况下操作。",
	"326021FE4FCA": "在 IG ON、发动机怠速且车速不高于 15 MPH（20 km/h）的情况下操作。",
	"326021FE4FCB": "在 IG ON 和发动机 ON 的情况下操作。",
	"326021FE4FCC": "在车辆停止和发动机怠速的情况下操作。",
	"326021FE4FCD": "在 IG ON、发动机停止、发动机冷却液温度不低于 104°F（40°C）和选挡杆位于 P 或 N 的情况下操作。",
	"326021FE4FCE": "在车辆停止、发动机怠速、冷却液温度不低于 104°F（40°C）和选挡杆位于 P 或 N 的情况下操作。",
	"326021FE4FCF": "检查模式下,在冷却液温度为 212°F（100°C）或更低温度时操作。",
	"326021FE4FD0": "在发动机暖机、怠速和选挡杆位于 P（AT）或空挡（MT）的情况下操作。\\n\\n\\n如果需要,则冷却器侧主动测试必须在 5 分钟之内完成。",
	"326021FE4FD1": "在 IG ON 和加速踏板松开的情况下操作。",
	"326021FE4FD2": "在发动机暖机的情况下操作。\\n本测试只能持续操作 2 秒。\\n在操作后 60 秒内,任何按键操作均被拒绝。\\nIG 转到 ON 后,30 秒内无法再次进行本测试。",
	"326021FE4FD3": "在冷却液温度为 212 °F（100 °C）或更低温度时操作。",
	"326021FE4FD4": "在 IG ON、发动机 ON、换挡挡域为 P（AT）或空挡（MT）的情况下操作。",
	"326021FE4FD5": "在 IG ON、发动机 ON、换挡挡域为 P（AT）或空挡（MT）的情况下操作。",
	"326021FE4FD6": "在 IG ON、发动机 OFF 和选挡杆位于 P 的情况下操作。\\n本测试需要发动机持续转动约 10 秒。按钮式点火开关可能需要按住按钮约 5 至 10 秒以完成本测试。转动时如果因蓄电池电压不足而导致出现错误,请连接蓄电池充电器。",
	"326021FE4FD7": "本测试将 DLC3 数据连接器的 TC 和 TE1 端子短路,并闪烁警告灯,以通过警告灯的闪烁次数来识别所存储的故障代码。",
	"326021FE4FD8": "本测试将换挡杆位置从 1 挡变为 2 挡,反之亦然。",
