	"326021FE4FDA": "本测试激活 SL1 电磁线圈以驾驶 / 停车。\\n完成本测试之后,将 IG 开关转到 OFF。",
	"326021FE4FDB": "本测试激活管路压力电磁线圈以驾驶 / 停车。\\n完成本测试之后,将 IG 开关转到 OFF。",
	"326021FE4FDC": "本测试激活蓄电池冷却风扇马达,并调节风扇转速到高 / 低。\\n注意：等待 3 至 10 秒,使冷却风扇转速逐步提高。",
	"326021FE4FDD": "本测试启动 THS 充电器充电。\\n可在数据表上以及根据 THS 充电器灯状态找到蓄电池充电激活状态。\\n完成本测试之后,将 IG 开关转到 OFF。\\n注意：本主动测试无法均衡蓄电池单元的电压差异。",
	"326021FE4FDE": "本测试限制变换器的 DTC 检测标准,因此在变换器保养过程中不会检测到 DTC。\\n应在变换器保养之前启动本功能。\\n如果变换器盖打开时尚未启动本功能,则 DTC 将被设置并存储在 ECU 中。\\n完成本测试之后,将 IG 开关转到 OFF。",
	"326021FE4FDF": "本测试将激活驾驶员座椅安全带马达。\\n可通过声音识别座椅安全带马达的操作。\\n可以在数据表上找到座椅安全带马达的状态。",
