	"326021FE4FEE": "本测试将 ECU 模式从正常模式更改为压缩测试模式。更改为压缩测试模式时,ECU 禁用来自发动机的点火火花和喷油器脉冲。\\n在进行发动机运转请求测试时,一定要遵守下述步骤：\\n1. 选择'运转请求'并选择 ON。\\n2. 踩住制动踏板。\\n3. 按住 IG 开关。\\n4. 松开制动踏板。\\n5. 踩住加速踏板,即使在发动机停止运转时也不要松开。\\n6. 要停止主动测试,再次按下 IG 开关并将 IG 转到 OFF。\\n7. 重新启动测试,以检查下一个气缸。",
	"326021FE4FEF": "本测试驱动水泵。\\n辅助蓄电池电压低于 9.5V。\\n完成本测试之后,将 IG 开关转到 OFF。",
	"326021FE4FF0": "本测试以 500rpm 驱动机油泵。\\n可在数据表上找到激活状态。\\n完成本测试之后,将 IG 转到 OFF。\\n注意：本测试只能运行 30 秒。\\n在本操作完成后 60 秒内,任何按键操作均被拒绝。",
