	"326021FE584C": "OFF:off\\n0:0\\n40:40\\n80:80\\n120:120\\n160:160\\n200:200\\n240:240\\n280:280\\n*根据不同的车可能会存在不同情况.",
	"326021FE584D": "OFF:OFF\\nMIN:MIN\\n-50%:-50%\\n0%:0%\\n100%:100%\\n200%:200%\\n300%:300%\\n400%:400%\\nMAX:MAX\\n*根据不同的车可能会存在不同情况.",
	"326021FE584E": "此测试禁止启动发动机。\\n（车辆进入EV模式，车辆仅由电动机功率运行。）\\n 1. 选择“电机驱动”并选择启动。\\n 2.将点火转至准备就绪，然后驾驶车辆。\\n 3.停止测试，请关闭点火。",
	"326021FE584F": "此测试通过保持恒定的发动机转速，使用大流量为混合动力充电。\\n 1. 选择“充电请求高”并选择启动。\\n 2.将点火转至准备就绪并驾驶车辆。\\n 3.停止测试， 请关闭点火。",
	"326021FE5850": "此测试通过保持恒定的发动机转速，使用大流量为混合动力充电。\\n 1. 选择“充电请求低”并选择启动。\\n 2.将点火转至准备就绪并驾驶车辆。\\n 3.停止测试， 请关闭点火。",
	"326021FE5851": "此测试在发电机恒速运转时，使用大流量为混合动力放电。\\n 1. 选择“充电请求高”并选择启动。\\n 2.将点火转至准备就绪并驾驶车辆。\\n 3.停止测试， 请关闭点火。",
	"326021FE5852": "此测试在发电机恒速运转时，使用小流量为混合动力放电。\\n 1. 选择“充电请求低”并选择启动。\\n 2.将点火转至准备就绪并驾驶车辆。\\n 3.停止测试， 请关闭点火。",
	"326021FE5853": "此测试通过以恒定的频率在充电状态范围中，使用一个大的变量，将混合动力电池在充电和放电状态之间切换。\\n 1. 选择“充电&放电大充电状态”并选择启动。\\n 2.将点火转至准备就绪并驾驶车辆。\\n 3.停止测试， 请关闭点火。",
	"326021FE5854": "此测试通过以恒定的频率在充电状态范围中，使用一个小的变量，将混合动力电池在充电和放电状态之间切换。\\n 1. 选择“充电&放电当前控制”并选择启动。\\n 2.将点火转至准备就绪并驾驶车辆。\\n 3.停止测试， 请关闭点火。",
	"326021FE5855": "此测试加热MG1和MG2，驱动MG1和MG2来确认温度传感器工作正常。\\n 1. 选择“已加热MG1/MG2”并选择启动。\\n 2.将点火转至准备就绪并驾驶车辆。\\n 3.停止测试， 请关闭点火。",
