	"326021FE5B4E": "此动作测试在-5【mm3/st】至+5【mm3/st】间增减预喷油量。\\n\\n\\n使用此动作测试诊断当发动机振动或爆震等现象出现时，预喷油量的性能变化。\\n\\n\\n查阅维修手册获取详细信息。",
	"326021FE5B4F": "此动作测试在-12.8【degca】至+12.7【degca】间增减喷油正时。\\n\\n\\n使用此动作测试诊断当发动机振动或爆震等现象出现时，喷油正时的性能变化和燃油性能的影响（劣质燃油或低十六烷燃油）。\\n\\n\\n查阅维修手册获取详细信息。",
