	"326021FE5D10": "该测试将自动变速器指示灯为熄灭/L/2/3（M）/4（M）/前进挡/空挡/倒车挡和驻车挡位置。\\n该动作测试仅显示并控制以下挡位选择指示灯：L/2/3（M）/4（M）/D/N/R/P\\n除此处所列外,动作测试不适用于其他挡位选择灯。\\n当自动变速器指示灯位于倒车挡位置时,倒车挡位置蜂鸣器可能会响起。",
	"326021FE5D11": "打开/向下：打开或倾斜向下移动\\n关闭/向上：关闭或倾斜向上移动",
	"326021FE5D13": "点火开关打开,发动机停止,换挡杆在驻车挡时操作。\\n该测试要求发动机连续启动约10秒钟。\\n完成该测试,需要按住点火开关按钮\\n约5到10秒钟。请连接\\n电池充电器,如果在启动期间发生\\n由电池电压不足导致的错误。",
	"326021FE5D17": "该测试激活EGR冷却器旁通VSV,强制再循环废气排放至旁通侧或冷却器侧以用于确定阻塞的原因。\\n如果车辆支持,可以将其设置成中间位置。\\n\\n\\n可以使用数据列表验证EGR冷却器旁通位置状态。",
