	"326021FE6DF3": "本测试激活安装在摄像机上的除霜器的加热器。",
	"326021FE6DF4": "本测试将激活进气口和直喷的喷射控制。本测试可切换进气口喷射和直喷控制。\\n\\n\\n- 车辆怠速时直喷\\n请注意进气口喷射操作最多可进行 3 分钟。必须进行直喷。\\n\\n\\n- 车辆怠速时进气口喷射\\n高燃油压力值过高时，可能会阻止切换至直喷。\\n由于发动机的热量，持续长时间进气口喷射会提高燃油温度，导致高燃油压力值增加。\\n驾驶车辆切换至直喷以降低高燃油压力值。",
	"326021FE6DF5": "本测试打开 / 关闭输油管加热器。",
	"326021FE6DF6": "操作时打开点火，关闭发动机，挂入驻车挡。\\n\\n\\n该测试执行最长不超过10秒。",
	"326021FE6DF7": "本测试同时改变燃油喷射方式和燃油喷射量。\\n\\n\\n- 车辆怠速时直喷\\n请注意进气口喷射操作最多可进行 3 分钟。必须进行直喷。\\n\\n\\n- 车辆怠速时进气口喷射\\n高燃油压力值过高时，可能会阻止切换至直喷。\\n由于发动机的热量，持续长时间进气口喷射会提高燃油温度，导致高燃油压力值增加。\\n驾驶车辆切换至直喷以降低高燃油压力值。",
	"326021FE6DF8": "本测试改变每个气缸的燃油喷射方式和燃油喷射停止。\\n\\n\\n- 车辆怠速时直喷\\n请注意进气口喷射操作最多可进行 3 分钟。必须进行直喷。\\n\\n\\n- 车辆怠速时进气口喷射\\n高燃油压力值过高时，可能会阻止切换至直喷。\\n由于发动机的热量，持续长时间进气口喷射会提高燃油温度，导致高燃油压力值增加。\\n驾驶车辆切换至直喷以降低高燃油压力值。",
	"326021FE6DFA": "本测试在多信息显示屏上显示锁止错误警告。",
	"326021FE6DFB": "本测试将 ECU 模式从正常模式更改为压缩测试模式。更改为压缩测试模式时，ECU 禁用来自发动机的点火火花和喷油器脉冲。\\n在进行发动机运转请求测试时，一定要遵守下述步骤：\\n1. 选择'运转请求'并选择 ON。\\n2. 踩住制动踏板。\\n3. 按住 IG 开关。\\n4. 松开制动踏板。\\n5. 要停止主动测试，再次按下 IG 开关并将 IG 转到 OFF。\\n6. 重新启动测试，以检查下一个气缸。",
	"326021FE6DFC": "本测试将 ECU 模式从正常模式更改为压缩测试模式。更改为压缩测试模式时，ECU 禁用来自发动机的点火火花和喷油器脉冲。\\n在进行发动机运转请求测试时，一定要遵守下述步骤：\\n1. 选择'运转请求'并选择 ON。\\n2. 踩住制动踏板。\\n3. 按住 IG 开关。\\n4. 松开制动踏板。\\n5. 要停止主动测试，再次按下 IG 开关并将 IG 转到 OFF。\\n6. 重新启动测试，以检查下一个气缸。",
