	"326021FE6DFF": "本测试熄灭 / 点亮蓄电池充电电流低警告灯。",
	"326621FA4C00": "预喷油量状态",
	"326621FA4C01": "请等待并保持发动机空转。\\n如果条件满足，屏幕将自动改变。",
	"326621FA4C02": "该功能仅可在大气力强超过阈值的情况下执行。如果大气压力未超过阈值，则执行“预喷油量学习值清除”功能。参考维修手册找出该车辆阈值。",
