	"326621FA4C08": "预喷油量状态",
	"326621FA4C09": "“预喷油量学习”失败。\\n确认预热灯处于闪烁模式，同时确认下一屏幕中每项的许可条件。\\n请参考维修手册获取详情。",
	"326621FA4C0A": "按退出按钮。关闭点火开关然后打开，然后再次执行此功能。",
	"326621FA4C0B": "“预喷油量学习（详细）”失败。\\n确认预热灯处于闪烁模式，同时确认下一屏幕中每项的许可条件。\\n请参考维修手册获取详情。",
	"326621FA4C0C": "输入字符数必须为12。",
