	"326621FA4D21": "详情",
	"326621FA4D22": "此功能调节怠速。\\n使用此功能时请参考维修手册。\\n同时使用数据列表确认当前怠速，使用激活测试确认理想怠速。\\n确认满足以下条件：\\n-打开发动机/电源开关（发动机关闭/Ready指示灯熄灭）\\n按“确定”继续。",
