	"326621FA4D2E": "欢迎进入智能编码清除向导。\\n此功能将清除除所有已注册钥匙的无线和智能功能，用来完成此程序的钥匙除外。\\n请确认点火开关打开。\\n\\n注意：任意步骤超时都会导致钥匙编码清除失败。",
