	"326621FA4D36": "确认满足条件。\\n\\n如果车辆有安全指示灯，检查指示灯，选择1或2。\\n如果没有，尝试启动发动机，选择3或4。",
	"326621FA4D37": "此功能用于在更换喷射器总成或喷射器时，为发动机ECU设置新喷射器总成或喷射器的补偿编码。\\n 按“确定”继续。",
