	"326621FA4D39": "按“确定”，然后选择一项功能继续。",
	"326621FA4D40": "按“确定”，然后选择一个汽缸继续。",
	"326621FA4D41": "输入喷射器上印刷的编码。\\n参考维修手册获取详情。\\n如果所输入字符正确，按“确定”继续。",
	"326621FA4D42": "按“确定”读取任意汽缸的补偿编码，或按“退出”退出此功能。",
