	"326621FA4D46": "所选汽缸编码已存在。\\n是否更换已有编码？",
	"326621FA4D47": "‘喷射器补偿’已完成。\\n按“确定”设置下一汽缸，或按“取消”退出该功能。",
	"326621FA4D48": "喷射器补偿已失败。\\n是否重试？",
