	"326621FA4D4C": "是否取消‘喷射器补偿’？",
	"326621FA4D4D": "按“确定”继续。\\n<注意>\\n如果要读取或保存该车辆的补偿编码，请使用‘学习值确认“功能或‘学习值保存”功能。",
	"326621FA4D4E": "‘喷射器补偿’已完成。\\n按“确定”设置下一汽缸，或按“退出”退出该功能。",
	"326621FA4D4F": "此功能用于在更换喷射器总成或喷射器时，为发动机ECU设置新喷射器总成或喷射器的补偿编码。\\n确认满足以下条件。\\n-打开发动机/电源开关（发动机关闭/Ready指示灯熄灭）。\\n按“确定”继续。",
	"326621FA4D50": "所输入编码有误。\\n请再次输入编码。",
	"326621FA4D51": "“喷射器补偿”已失败。\\n请检查条件。\\n-打开发动机/电源开关（发动机关闭/Ready指示灯熄灭）。\\n请参考维修手册获取详情。\\n是否重试？",
	"326621FA4D52": "写入选定汽缸补偿代码完成。\\n按“确定”按清除更换汽缸学习值。",
	"326621FA4D53": "执行以下操作然后按“确定”。\\n-打开发动机/电源开关。",
	"326621FA4D54": "喷射器补偿已完成。\\n执行以下操作。\\n-打开发动机/电源开关（发动机关闭/Ready指示灯熄灭）.",
	"326621FA4D55": "欢迎进入‘智能编码注册’向导。\\n此功能将为智能钥匙注册无线和智能功能。\\n请确认点火开关打开。\\n注意：\\n-任意步骤超时都会导致智能编码注册失败。\\n-子钥匙没有智能功能；子钥匙只能注册无线功能。",
	"326621FA4D56": "可注册的智能钥匙数",
	"326621FA4D57": "已注册的智能钥匙数。",
	"326621FA4D58": "在30秒内对点火槽内的智能钥匙执行以下操作：\\n-同时按下‘锁定’和‘解锁’按钮1秒钟。\\n-再次按下‘锁定’和‘解锁’按钮其中之一。",
	"326621FA4D59": "智能编码注册失败。\\n最大钥匙数已被注册。\\n可使用智能钥匙清除功能删除智能钥匙。",
	"326621FA4D5A": "后期步骤摘要。\\n后期步骤有30秒计时，因此摘要如下所列。\\n步骤 2 - 使用已注册主钥匙\\n-按‘锁定’。\\n步骤 3-使用需注册钥匙\\n-同时按下‘锁定’和‘解锁’按钮1秒钟。\\n-三秒内再次按下‘锁定’。",
	"326621FA4D5B": "步骤3（共3步）",
	"326621FA4D5C": "步骤2（共2步）",
	"326621FA4D5D": "步骤2（共3步）\\n在30秒内对点火槽上的已注册智能钥匙执行以下操作：\\n-按下智能钥匙上的按钮。",
	"326621FA4D5E": "步骤1（共2步）",
	"326621FA4D5F": "欢迎进入智能编码注册向导。\\n该功能将注册智能钥匙中的智能部分。\\n确认满足以下条件：\\n-防盗编码已注册。\\n-电源/发动机开关打开(IG)。\\n-智能取消功能关闭。",
	"326621FA4D60": "剩余可注册钥匙数。",
	"326621FA4D61": "-关闭电源/发动机开关，移除钥匙槽上的未注册钥匙。\\n-同时按下‘锁定’和‘解锁’按钮1秒钟。\\n-再次按下‘锁定’。\\n     正在注册",
	"326621FA4D62": "后期步骤摘要。\\n后期步骤有30秒计时，因此摘要如下所列.\\n步骤 2 - 按下注册钥匙上的‘锁定’。\\n步骤 3\\n-在未注册钥匙上，同时按下‘锁定’和‘解锁’按钮1秒钟。\\n-三秒内再次按下‘锁定’。",
	"326621FA4D63": "智能编码注册未在规定时间内完成。\\n确认以下条件：\\n-有多余空间增加另一把钥匙。\\n-电源/发动机开关打开(IG).\\n是否重试？",
	"326621FA4D64": "按“确定”继续",
	"326621FA4D65": "<确认>\\n使用已注册钥匙触碰点火开关。\\n\\n<注意>\\n确保车标侧面向点火开关。\\n剩余钥匙：",
	"326621FA4D66": "步骤1（共3步）n使用待注册钥匙触碰点火开关。\\n\\n<警告>\\n确保车标侧面向点火开关。",
	"326621FA4D67": "步骤2（共3步）\\n设置乘客座椅上钥匙。",
	"326621FA4D68": "步骤3（共3步）\\n确保所有步骤已完成。\\n如果要注册另一钥匙编码，使用待注册钥匙触碰点火开关。\\n然后按下‘注册’以注册您所选中的钥匙编码。",
	"326621FA4D69": "最后一个已选中钥匙编码未注册。\\n其他已选钥匙编码已注册。\\n确认已注册钥匙编码当前数量。\\n按“确定”注册另一钥匙编码，或按“退出”退出此功能。",
	"326621FA4D6A": "注册",
	"326621FA4D6B": "<警告>\\n确认已注册在先前安装的认证ECU的所有钥匙已准备好。\\n将它们注册在新ECU之前请逐个进行确认。\\n按“确定”继续。",
	"326621FA4D6C": "拆卸或安装多模式手动变速器系统相关的零件时使用该功能。\\n确认维修手册中零件的详细信息。\\n按“确定”继续。",
	"326621FA4D6D": "是否退出‘部件更换’？",
	"326621FA4D6E": "确认以下条件。\\n-发动机未在运转。\\n-点火开关打开。\\n-换挡杆在空挡位置\\n-未检测到故障码 'P0802'或'P0725'或'U0100'。\\n-电池电压大于8 V。\\n按“确定”继续。",
	"326621FA4D6F": "选择合适的操作，然后按“确定”继续。",
	"326621FA4D70": "初始化失败。\\n检查初始化条件。\\n-发动机未在运转。\\n-点火开关打开。\\n-换挡杆在空挡位置\\n-未检测到故障码 'P0802'或'P0725'或'U0100'。\\n-电池电压大于8 V。\\n是否重试？",
	"326621FA4D71": "选择已更换部件，已移除和已安装部件，然后按“确定”继续。",
