	"326621FA4DC8": "该ECU没有已注册钥匙。",
	"326621FA4DC9": "是否退出“防盗编码重置”？",
	"326621FA4DCA": "输入VIN码\\n无法从车辆获取VIN码。\\n必须输入VIN码。\\n如果输入的字符正确，请按“确定”继续。",
	"326621FA4DCB": "重置需要花费20分钟完成。\\n是否启动防盗器重置？",
	"326621FA4DCC": "’防盗器编码重置‘失败。\\n无法进行ECU安全释放。\\n是否重试？",
	"326621FA4DCD": "’防盗器编码重置‘失败。\\nECU无法启动清除功能。\\n是否重试？",
	"326621FA4DCE": "步骤2（共4步）\\n正在重置",
	"326621FA4DCF": "’防盗编码重置‘失败。\\n步骤超时。",
	"326621FA4DD0": "防盗器编码重置失败。\\nECU可能对钥匙核实失败。\\n请确认钥匙。",
	"326621FA4DD1": "欢迎进入“学习值确认”功能。\\n该功能用于确认补偿编码或学习值。\\n按“确定”继续。",
	"326621FA4DD2": "<注意>\\n 禁止在未参考维修手册的情况下执行该功能。\\n\\n确认以下条件。\\n-发动机关闭。\\n-点火开关打开\\n按“确定”继续。",
	"326621FA4DD3": "选择“补偿编码”或“学习值”，然后按“确定”继续。",
	"326621FA4DD4": "是否退出’学习值确认‘功能?",
	"326621FA4DD5": "预喷油量当前学习值",
	"326621FA4DD6": "初始化",
	"326621FA4DD7": "CUR",
	"326621FA4DD8": "欢迎进入“学习值保持”功能。\\n该功能用于存储补偿编码和学习值。\\n按“确定”继续。",
	"326621FA4DD9": "此处无需存储编码。\\nh 请手动操纵执行编码输入或学习。",
	"326621FA4DDA": "保存日期 ",
	"326621FA4DDB": "该编码已保存。\\n是否要覆写？",
	"326621FA4DDC": "覆写",
	"326621FA4DDD": "“保存学习值”已完成。",
	"326621FA4DDE": "错误 “学习值保存”",
	"326621FA4DDF": "读取编码有误。\\n请手动操纵执行编码输入或学习。",
	"326621FA4DE0": "读取代码失败。\\n按“确定”退出此功能。",
	"326621FA4DE1": "是否退出’学习值保存‘功能？",
	"326621FA4DE2": "发动机ECU",
	"326621FA4DE3": "发动机组件",
	"326621FA4DE4": "喷射器组件",
	"326621FA4DE5": "空燃比传感器",
