	"326621FA4DE7": "DPF催化器",
	"326621FA4DE8": "按“确定”继续，然后确认已更换或待更换组件。",
	"326621FA4DE9": "欢迎进入“学习值写入”功能。\\n该功能用于设置补偿编码或学习值到发动机ECU中。\\n按“确定”继续。",
	"326621FA4DEA": "以下设置已完成。",
	"326621FA4DEB": "请执行以下操作。",
	"326621FA4DEC": "所有设置已完成。",
	"326621FA4DED": "写入编码失败。",
	"326621FA4DEE": "错误 “学习值写入”",
	"326621FA4DEF": "已保存数据不适用于该车辆。\\n请再次保存或手动操作。",
	"326621FA4DF0": "是否退出’学习值写入‘功能？",
	"326621FA4DF1": "此功能用于存储补偿编码和学习值。\\n使用此功能时请查阅维修手册。\\n确认以下条件。\\n-打开发动机/电源开关（发动机关闭/Ready指示灯熄灭）。\\n按“确定”继续。",
	"326621FA4DF2": "学习值保存失败。\\n请检查条件。\\n-打开发动机/电源开关（发动机关闭/Ready指示灯熄灭）.\\n请参考维修手册获取详情。\\n请按确定按钮退出该功能。",
	"326621FA4DF3": "是否写入此编码？",
	"326621FA4DF4": "写入编码失败。\\n 是否重试？\\n如果已存储数据多次尝试后仍无法写入，请执行“车辆里程写入”功能。",
	"326621FA4DF5": "学习值写入失败。\\n请检查条件。\\n-打开发动机/电源开关（发动机关闭/Ready指示灯熄灭）。\\n请参考维修手册获取详情。",
	"326621FA4DF6": "此功能用于写入保存在诊断工具中的补偿编码和学习值。\\n使用此功能时请查阅维修手册。\\n确认以下条件。\\n-打开发动机/电源开关（发动机关闭/Ready指示灯熄灭）。\\n按“确定”继续。",
	"326621FA4DF7": "正在写入...",
	"326621FA4DF8": "学习值写入完成。\\n如果有除ECU以外的已更换部件，请执行相应功能。\\n请参考维修手册获取详情。",
	"326621FA4DF9": "欢迎进入ECB功能。\\n该功能可为电子控制制动系统（ECB）执行以下服务功能。\\n请按“确定”选择一项服务功能。",
	"326621FA4DFA": "后部下降为零",
	"326621FA4DFB": "执行以下操作，然后按“确定”。\\n1.关闭点火开关然后打开。\\n2.确认ABS电机泵启动然后停止。",
	"326621FA4DFC": "确认满足以下条件。\\n-应用驻车制动\\n-换挡杆在P位置\\n-点火开关打开\\n-发动机关闭/Read指示灯熄灭\\n提示：\\n-松开右后钳盘式制动器的放油塞。\\n-请勿踩下制动踏板。\\n按“确定”继续。",
	"326621FA4DFD": "确认满足以下条件。\\n-施加驻车制动\\n-换挡杆在P位置\\n-点火开关打开\\n-发动机关闭/Read指示灯熄灭\\n-电池电压正常。\\n-制动器温度正常。\\n按“确定”继续。",
	"326621FA4DFE": "该功能执行失败。\\n确认满足以下条件：\\n1.应用驻车制动。\\n2.换挡杆在P位置。\\n3.点火开关打开。\\n4.发动机关闭/Read指示灯熄灭\\n是否重试？",
	"326621FA4DFF": "预喷油量状态（CAT）",
	"326621FB4D00": "<用途>\\n该功能用于更换座椅靠垫套装或座椅靠垫装饰罩之后。\\n\\n<简介>\\n更换座椅靠垫套装或座椅靠垫装饰罩之后，此项功能可标定座椅占用检测ECU。",
	"326621FB4D01": "欢迎使用零点标定功能。\\n此功能可标定座椅占用检测ECU。\\n\\n以下任一部件更换后请使用此功能。\\n\\n-座椅靠垫套装\\n-座椅靠垫装饰罩\\n\\n按“确定”继续。",
	"326621FB4D02": "请确认是否满足以下条件。\\n\\n-车辆停放在水平面。\\n-座椅上未放置任何物件。\\n-安全带扣开关已关闭。\\n\\n按“确定”继续。",
	"326621FB4D03": "请确认座椅位置。\\n\\n滑块：最后端\\n靠背倾斜：向上最高处\\n\\n如配备以下功能，请确认相应条件是否满足。\\n\\n向前高度：向上最高处\\n升降器：向下最低处\\n\\n按【确定】继续。",
	"326621FB4D04": "检索错误",
	"326621FB4D05": "与车辆失去通信。\\n按下“确定”重新初始化ECU，并返回当前功能顶部。",
	"326621FB4D06": "正在标定。请稍后。",
