	"326621FB4D0E": "零点标定已完成。",
	"326621FB4D0F": "是否退出'零点标定'？",
	"326621FB4D10": "<用途>\\n更换座椅占用检测ECU、座椅占用检测传感器或乘客座椅后，请标定座椅占用检测ECU。\\n\\n<简介>\\n此功能可标定保存在座椅占用检测ECU内座椅占用检测传感器的零点。",
	"326621FB4D12": "此功能可标定保存在座椅占用检测ECU内座椅占用检测传感器的零点。\\n确认是否满足以下条件。\\n-发动机/电源开关已打开（发动机关闭/准备就绪关闭）。\\n-车辆停放在水平面。\\n-乘客座椅上未放置任何物件。\\n-乘客座椅未与任何物品接触。\\n\\n按【确定】继续。",
	"326621FB4D15": "零点标定已完成。",
