	"326621FC483C": "测试模式已失败。\\n确认初始条件是否满足：\\n-车辆停止。\\n是否再试一次？",
	"326621FC483D": "等待10秒。\\n剩余时间：",
	"326621FC483E": "EMPS异常操作功能已失败。\\n确认以下条件是否满足：\\n1.准备就绪指示灯熄灭。\\n2.点火开关转至打开位置。\\n是否再试一次？",
	"326621FC483F": "秒",
	"326621FC4840": "“盲点监测系统主光轴检查”失败。\\n确认以下条件是否满足：\\n-点火开关已转至“打开”位置；\\n-盲点监测系统主开关已转至“打开”位置；\\n-除C1ABB以外未检测到其他故障码。\\n是否重试？",
	"326621FC4841": "此功能用于在没有注册智能钥匙的情况下，将点火开关转至“ON”位置（发动机停止/准备就绪指示灯熄灭）。\\n\\n确定以下条件是否满足：\\n-将点火开关转至“关闭”位置；\\n-车内无任何已注册智能钥匙；\\n-所有车门和发动机罩均已关闭；\\n-车辆未处于智能钥匙注册模式。\\n\\n按【确定】激活强制打开点火开关。",
	"326621FC4842": "强制打开点火开关已失败。\\n确认以下条件是否满足：\\n-将点火开关转至“关闭”位置；\\n-车内无已注册智能钥匙；\\n-所有车门和发动机罩均已关闭；\\n-车辆未处于智能钥匙注册模式。\\n\\n是否重试？",
	"326621FC4843": "“激光光轴调节”已停止。\\n\\n原因：车速条件未满足。\\n“激光光轴调节”尚未结束。\\n关闭发动机/电源开关并重试。",
	"326621FC4844": "车辆GCU未激活。\\n\\n按下【确定】按钮激活GCU。",
	"326621FC4845": "正在激活GCU。\\n请稍候。",
	"326621FC4846": "已成功完成GCU激活。",
