	"326621FC4848": "初始化条件不满足学习。\\n是否重试？",
	"326621FC4849": "诊断前电池充电已完成。\\n\\n关闭发动机/电源开关，然后再打开（发动机停止/准备就绪指示灯熄灭）。",
	"326621FC484A": "打开电源开关（准备就绪指示灯）。\\n界面变化，该功能将自动启动。\\n\\n警告：\\n准备就绪指示灯不会点亮。\\n换档杆（驻车档除外）或电源开关的任何操作将会导致功能终止。\\n按【退出】结束该功能",
	"326621FC484B": "“诊断前电池充电”失败。\\n确认符合以下条件。\\n- 点火开关在ON位置\\n- 准备就绪指示灯熄灭\\n- 挂驻车档\\n- 电池温度合适\\n- 电池连接恰当\\n- 未储存HV相关的故障码\\n\\n关闭电源开关。",
	"326621FC484C": "该功能用于在发动机机油压力切换阀打开并关闭后，测量机油压力的平均值。\\n\\n当发动机机油压力控制系统发生故障时使用该功能。\\n当你使用该功能时请参考维修手册。\\n\\n按【确定】继续。",
	"326621FC484D": "确认以下条件是否满足。\\n-发动机打开/准备就绪指示灯打开。\\n-车辆停止。\\n-换挡杆在P（自动挡）或N位置（手动挡）。\\n-发动机机油温度在制定范围内。\\n\\n当测量发动机机油压力时，发动机转速受限。\\n请参考维修手册获取详细信息。\\n\\n按下【确定】继续。",
	"326621FC484E": "将加速踏板踩到底。",
	"326621FC484F": "发动机转速",
	"326621FC4850": "确认发动机转速稳定后，按下【确定】按钮。",
	"326621FC4851": "发动机机油压力测量完成。\\n如要取消发动机安全控制系统，松开加速踏板然后按下【确定】。",
	"326621FC4852": "阀运转时0.5秒内的发动机平均油压如下。\\n请确认信息是否与维修手册相匹配。\\n按【详情】查看原始数据。",
	"326621FC4853": "阀运转时0.5秒内的发动机油压如下，每0.1秒取值一次。",
	"326621FC4854": "安全控制系统取消失败。\\n\\n关闭发动机/电源开关再打开，然后按下【确定】。",
	"326621FC4855": "阀激活失败。\\n\\n确认以下条件是否满足。\\n-打开发动机/准备就绪指示灯点亮。\\n-车辆停止。\\n-换挡杆在P（自动挡）或N（手动挡）位置。\\n-发动机机油温度在指定值范围内。\\n\\n参考维修手册获取更多信息。\\n\\n进入下一界面前，关闭发动机/电源开关然后再打开。\\n\\n是否重试？",
	"326621FC4856": "阀激活失败。\\n\\n确认以下条件是否满足。\\n-打开发动机/准备就绪指示灯点亮。\\n-车辆停止。\\n-换挡杆在P（自动挡）或N（手动挡）位置。\\n-发动机机油温度在指定值范围内。\\n\\n参考维修手册获取更多信息。\\n\\n是否重试？",
	"326621FC4857": "是否要退出“发动机机油喷射控制检查”功能？\\n若要退出，松开加速踏板然后按下【是】。",
