	"326621FC4895": "此功能用于校准乘客座椅传感器。\\n\\n确认以下条件是否满足：\\n-发动机/电源开关已打开（发动机停止/“准备就绪”指示灯熄灭）；\\n-座椅加热器开关关闭；\\n-空调开关关闭。\\n\\n按【确定】继续。",
	"326621FC4896": "确认以下条件是否满足：\\n\\n-乘客座椅上未放置任务物体；\\n-车内温度保持在 14°F（-10°C）到77°F（25°C）之间。\\n\\n按【确定】开始校准乘客座椅传感器。",
