	"326621FC48C2": "涡流阀学习值重置",
	"326621FC48C3": "此功能用于重置“涡流阀学习值”。\\n\\n请在更换涡流阀后执行此功能。\\n使用此功能前请查阅维修手册。\\n\\n确认满足以下条件。\\n-打开发动机/电源开关（发动机熄火/准备就绪指示灯熄灭）。\\n\\n按【确定】开始重置。",
