	"326621FC48CA": "当前为测试模式。\\n\\n按【确定】切换模式。",
	"326621FC48CB": "该功能用于偏航率传感器零点标定。\\n\\n确保满足以下条件。\\n-车辆停放在水平面上。\\n-车辆内无任何人员。\\n-车辆静止。\\n-发动机/电源开关打开（发动机熄火/准备就绪指示灯熄灭）。\\n\\n按下【确定】按钮启动偏航率传感器零点标定。",
	"326621FC48CC": "“偏航率传感器零点标定”完成。",
	"326621FC48CD": "是否退出“偏航率传感器零点标定”功能？",
	"326621FC48CE": "“偏航率传感器零点标定”失败。\\n确保满足以下条件。\\n-车辆停放在水平面上。\\n-车辆内无任何人员。\\n-车辆静止。\\n-发动机/电源开关打开（发动机熄火/准备就绪指示灯熄灭）。\\n\\n是否重试？",
	"326621FC48CF": "此功能用于识别车辆是否接收到来自遥控钥匙的信号。\\n\\n确认满足以下条件：\\n-发动机开关已打开（发动机熄火/准备就绪指示灯熄灭）。\\n\\n按【确定】继续。",
	"326621FC48D0": "是否退出“遥控车门锁止诊断模式”功能？",
	"326621FC48D1": "按下遥控钥匙上的【锁止】或【解锁】按钮，然后使用以下信息检查遥控器状态。\\n<间歇蜂鸣>\\n-遥控钥匙当前已注册\\n<持续蜂鸣>\\n-遥控钥匙未注册\\n<无蜂鸣>\\n-车辆可能未接收来自遥控器的信号\\n-正在使用的遥控器可能与该车不兼容",
	"326621FC48D2": "正常电池组平均电压计算",
	"326621FC48D3": "“正常电池组平均电压计算”功能执行失败。\\n确认满足以下条件。\\n-点火开关打开\\n\\n是否重试？",
	"326621FC48D4": "“间距声纳探测系统调节（简单）”执行失败。\\n参考维修手册获取更多信息",
	"326621FC48D5": "由于检测到除C1AF0以外的故障码，“间距声纳探测系统调节（简单）”无法执行。\\n当除C1AF0以外未检测到其他故障码时，再次进行尝试。",
	"326621FC48D6": "该功能用于确认间距声纳总成，以及校准间距声纳探测区域。\\n参考维修手册获取更详细的信息。\\n\\n确认满足以下条件。\\n-车辆停放在水平面上。\\n-车辆空载。\\n-发动机/电源打开（发动机熄火/准备就绪指示灯熄灭）。\\n-车辆静止。\\n\\n按下【确定】按钮继续。",
	"326621FC48D7": "是否退出“间距声纳探测系统校准（简单）”功能？",
	"326621FC48D8": "选择一个间距声纳系统进行校准并按【确定】继续。\\n1.前间距声纳系统\\n2.后间距声纳系统\\n3.前/后间距声纳系统",
