	"326621FC4900": "新ECU（重置）：标准型\\n\\n如注册一把新智能钥匙，请遵循以下步骤。\\n\\n步骤1\\n 用待注册钥匙接触发动机/电源开关。车辆识别出钥匙后会发出一声蜂鸣声。\\n步骤2\\n将待注册钥匙放置在乘客座椅上来完成注册。\\n如注册一把待追加钥匙，请前往步骤3。\\n如果所有钥匙都已注册，请前往步骤6。\\n步骤3\\n将已注册的钥匙带出车外。\\n步骤4\\n 将待注册钥匙放置在车内。\\n步骤5\\n 用待注册钥匙接触发动机/电源开关。车辆识别钥匙后会发出一声蜂鸣声。\\n从步骤2重复。\\n步骤6\\n 注册完成界面出现时，表示注册已完成。\\n\\n以上是注册过程的详细说明。请关闭此窗口，回到功能界面，按下【启动】。",
	"326621FC4901": "将该钥匙放置乘客座椅上。\\n\\n在规定时间内进行以下操作。",
	"326621FC4902": "注册另一个钥匙码。\\n\\n已注册钥匙码的数量",
	"326621FC4903": "如要注册另一个钥匙码，请执行以下操作。\\n步骤1. 将已注册钥匙带出车外。\\n步骤2. 把将待注册的新钥匙放入车内。\\n步骤3. 用待注册钥匙接触发动机开关（发出蜂鸣声）。\\n\\n注册完成后，请按【注册】按钮。",
	"326621FC4904": "此功能可显示可变气门正时初始位置的学习值。\\n使用此功能时请查阅维修通告。\\n\\n确认以下条件是否满足：\\n-打开发动机/电源开关（发动机停止/准备就绪指示灯熄灭）。\\n\\n按【确定】继续。",
