	"326621FC4922": "欢迎进入一切准备就绪测试功能。\\n\\n此功能可显示相关系统监控状态，以备进行维修确认。\\n\\n按【确定】继续。",
	"326621FC4923": "请输入期望故障码以同时检查监控状态和故障码状态。\\n\\n按【确定】继续。",
