	"326621FC492A": "与故障码输入相关的监控尚未完成。",
	"326621FC492B": "扭矩传感器调节已失败。\\n\\n只存在C1515/C1525/C1581故障码。\\n请进行诊断，并清除其他故障码，\\n然后进行扭矩传感器调节。",
	"326621FC492C": "更换ECU或发动机组件后，此功能可保存/写入/查看/清除历史数据。\\n\\n请参考维修手册，查询哪些组件拆卸/安装时需要使用此功能。\\n\\n按【确定】继续。",
	"326621FC492D": "确认以下条件是否满足：\\n\\n-发动机已停止；\\n-点火开关已转至“打开”位置；\\n-电池电压正常。\\n\\n未参考维修手册的情况下，\\n无法执行此功能。\\n\\n按【确定】继续。",
	"326621FC492E": "根据当前车辆状态\\n选择合适的选项，再按【确定】。\\n\\n1. 查看历史数据\\n1. 保持历史数据\\n3. 写入历史数据\\n4. 清除历史数据",
