	"326621FC493F": "保存已有历史数据\\n\\n是否覆盖？",
	"326621FC4940": "确认以下条件是否满足。\\n\\n-点火开关已转至“关闭”位置。\\n\\n按【确定】继续。",
	"326621FC4941": "请等待30秒。",
	"326621FC4942": "确认以下条件是否满足：\\n\\n-点火开关已转至“打开”位置；\\n-发动机已停止；\\n-电池电压正常。\\n\\n按【确定】继续。",
	"326621FC4943": "是否写入该数据？",
	"326621FC4944": "该数据已写入ECU。\\n\\n按【查看】可查看ECU当前保存的历史数据。",
	"326621FC4945": "发动机历史数据",
	"326621FC4946": "PM累积历史数据",
	"326621FC4947": "确认以下条件是否满足：\\n\\n-点火开关已转至“打开”位置；\\n-发动机已停止；\\n-电池电压正常。\\n\\n按【确定】清除所选历史数据。\\n（车辆当前数据将立即覆盖历史数据。）",
	"326621FC4948": "所选数据已清除。\\n\\n按【查看】可查看ECU当前保存的历史数据。",
	"326621FC4949": "已保存数据不适用于该车辆。\\n\\n请再次保存。",
	"326621FC494A": "是否退出发动机历史数据功能？",
	"326621FC494B": "选择待清除项目",
	"326621FC494C": "转速",
	"326621FC494D": "发动机过速次数",
	"326621FC494E": "欢迎进入排气功能。\\n\\n此功能用于清除电子控制制动系统中的空气。\\n\\n注意：\\n排气时，确保制动液位不低于储液罐标注的最低液位。\\n\\n按【确定】继续。",
	"326621FC494F": "选择所需的管线,然后按“确定”。",
	"326621FC4950": "请先确定以下条件是否满足，再按【确定】。\\n\\n-车辆已停止；\\n-手刹已拉起；\\n-电源开关已打开；\\n-准备就绪指示灯已熄灭。",
	"326621FC4951": "松开右后轮排气螺塞，\\n踩下制动踏板。\\n\\n踩住制动踏板不动，直到制动液的空气完全排出。\\n\\n制动液的空气完全排出后，拧紧排气螺塞，松开制动踏板。\\n\\n按【确定】继续。",
	"326621FC4952": "松开左后轮排气螺塞，\\n踩下制动踏板。\\n\\n踩住制动踏板不动，直到制动液的空气完全排出。\\n\\n制动液的空气完全排出后，拧紧排气螺塞，松开制动踏板。\\n\\n按【确定】继续。",
	"326621FC4953": "松开左前轮排气螺塞，反复踩下制动踏板\\n进行排气。\\n\\n左前轮制动液的空气完全排出后，拧紧排气螺塞，松开制动踏板。\\n\\n按【确定】继续。",
	"326621FC4954": "松开右前轮排气螺塞，反复踩下制动踏板\\n进行排气。\\n\\n右前轮制动液的空气完全排出后，拧紧排气螺塞，松开制动踏板。\\n\\n按【确定】继续。",
	"326621FC4955": "下一屏幕操作将降低蓄能器压力。\\n\\n压降过程将持续\\约10秒。",
	"326621FC4956": "正在进行中\\n\\n请稍等10秒。",
	"326621FC4957": "ABS泵电机停止运行后，按【确定】。",
	"326621FC4958": "将制动液注入储液罐内，加注到最高液位线。\\n\\n按【确定】继续。",
	"326621FC4959": "请先确定以下条件是否满足，再按【确定】。\\n\\n-车辆已停止；\\n-手刹已拉起；\\n-电源开关已打开；\\n-准备就绪指示灯已熄灭；\\n-储液罐液位开关已断开。",
	"326621FC495A": "执行行程模拟器排气程序。\\n\\n先按【确定】按钮，再进行\\n以下操作。\\n\\n-排出行程模拟器中的空气；\\n-排出左前轮的空气；\\n-排出右前轮的空气。\\n\\n注意：\\n请在30分钟内完成以上操作。\\n\\n按【确定】开始执行排气程序。",
	"326621FC495B": "松开行程模拟器的排气螺塞，\\n反复踩下、松开制动踏板，\\n直到制动液的空气完全排出。\\n\\n行程模拟器中\\n制动液的空气完全排出后，拧紧排气螺塞。\\n\\n按【确定】继续。",
	"326621FC495C": "松开左前轮排气螺塞，\\n踩下制动踏板。\\n\\n踩住制动踏板不动，直到制动液的空气完全排出。\\n\\n左前轮制动液的空气\\n完全排出后，拧紧排气螺塞，松开制动踏板。\\n\\n按【确定】继续。",
	"326621FC495D": "松开右前轮排气螺塞，\\n踩下制动踏板。\\n\\n踩住制动踏板不动，直到制动液的空气完全排出。\\n\\n右前轮制动液的空气\\n完全排出后，拧紧排气螺塞，松开制动踏板。\\n\\n按【确定】继续。",
	"326621FC495E": "确定以下操作均已完成后\\n按【确定】按钮。\\n\\n-排出行程模拟器中的空气；\\n-排出左前轮的空气；\\n-排出右前轮的空气。\\n\\n注意：\\n如按下【后退】按钮，行程\\模拟器排气程序将重启。",
	"326621FC495F": "正在进行中\\n\\n请稍等90秒。",
	"326621FC4960": "ABS泵电机停止运行后，关闭电源\\n开关，再重新连接储液罐液位开关。\\n\\n按【确定】继续。",
	"326621FC4961": "打开电源开关（准备就绪指示灯熄灭）。\\n放下手刹。\\n\\n按【确定】执行线性阀门偏差\\n标定程序。",
	"326621FC4962": "正在进行中……\\n\\n制动告警灯会慢闪。\\n标定程序结束后，\\n制动告警灯将转为快闪。\\n\\n当制动告警灯开始快闪时，\\n请拉起手刹。\\n\\n按【确定】继续。",
	"326621FC4963": "空气排出已完成。",
	"326621FC4964": "是否退出'排气'程序？",
	"326621FC4965": "查看",
	"326621FC4966": "保存已有历史数据。\\n是否覆盖？",
	"326621FC4967": "数据已保存。\\n\\n保存日期",
	"326621FC4968": "此功能用于在电磁阀或阀门总成更换后，进行补偿码重置和电控变速器ECU初始化。\\n\\n按【确定】继续。",
	"326621FC4969": "<注意>\\n在执行该功能前必须先查看维修手册。\\n\\n确认以下条件是否满足。\\n-已挂入驻车档。\\n-车俩停止。\\n-发动机熄火。\\n-点火开关已转至“打开”位置。\\n-电池电压高于8伏。\\n\\n按【确定】继续。",
	"326621FC496A": "自动变速箱代码重置已失败。\\n\\n确认以下条件是否满足。\\n-已挂入驻车档。\\n-车俩停止。\\n-发动机熄火。\\n-点火开关已转至“打开”位置。\\n-电池电压高于8伏。\\n\\n是否再试一次？",
	"326621FC496B": "是否退出自动变速箱代码重置功能？",
	"326621FC496C": "此功能用于重置TPMS系统。\\n\\n确定以下条件是否满足。\\n-发动机/电源开关已打开（发动机停止/准备就绪指示灯熄灭）。\\n\\n按【确定】重置TPMS系统。",
	"326621FC496D": "TPMS系统重置已完成。\\n\\n打开发动机/电源开关（发动机已停止/准备就绪指示灯熄灭）。",
	"326621FC496E": "TPMS系统重置已失败。\\n\\n打开发动机/电源开关（发动机已停止/准备就绪指示灯熄灭）。\\n\\n是否再试一次？",
	"326621FC496F": "是否退出TPMS系统重置功能？",
	"326621FC4970": "该功能用于切换多信息显示栏上机油保养警告灯和剩余英里数的显示方式。\\n\\n当使用该功能时请参考维修手册。\\n\\n确保下面的条件。\\n-打开发动机/电源开关（发动机熄火/Ready指示灯熄灭）。\\n\\n按确定继续。",
	"326621FC4971": "选择要执行的条目，然后按确定继续。",
	"326621FC4972": "回到初始显示方式",
	"326621FC4973": "切换显示方式",
	"326621FC4974": "将发动机/电源开关转到OFF和ON(发动机OFF/Ready OFF)。\\n\\n按确定继续。",
	"326621FC4975": "切换机油保养显示完成。\\n\\n当前设置如下。",
	"326621FC4976": "模式",
	"326621FC4977": "当前设置如下。",
	"326621FC4978": "切换多信息显示栏上机油保养警告灯和剩余英里数的显示方式。\\n\\n按确定继续。",
	"326621FC4979": "选择要切换的显示方式，然后按确定继续。",
	"326621FC497A": "设置",
	"326621FC497B": "剩余英里数",
	"326621FC497C": "条件",
	"326621FC497D": "在多信息显示栏上同时显示机油保养警告灯和剩余英里数。",
	"326621FC497E": "在多信息显示栏上显示机油保养警告灯之后显示剩余英里数。",
