	"326621FC4F2B": "由于检测到C1515/C1516以外的诊断代码\\n，扭矩传感器调零失败。\\n请在没有检测到上述C1515/C1516以外的诊断代码的状态下，\\n再次实施扭矩传感器调零。",
	"326621FC4F2C": "发生通信故障.\\n\\n中断处理，并返回功能开始界面。如果这个问题没有得到解决。\\n请提供故障报告。",
