	"326621FC4F39": "钥匙删除错误",
	"326621FC4F3F": "本功能为进行智能钥匙的注册。\\n\\n请确认以下条件。\\n-点火开关 ON \\n-车内存在移动电话的情况OFF \\n\\n注意：\\n如果未能在限制时间内完成操作\\n则注册失败。",
	"326621FC4F40": "< 注意 >\\n\\n请准备好所有已注册到交换前的配对电子控制单元中的钥匙\\n。\\n\\n请对准备好的所有智能钥匙进行配对。\\n请每次只带一把未注册的钥匙进入到车内。\\n\\n请按压“确定”按钮。",
	"326621FC4F41": "请用已完成注册的钥匙与电源/发动机开关接触进行配对。\\n\\n< 注意 >\\n请用已完成注册的钥匙的标记面与电源/发动机开关接触。",
	"326621FC4F42": "步骤1（共3步）\\n\\n请用需要进行注册的钥匙与电源/发动机开关接触进行配对。\\n\\n< 注意 >\\n请用需要进行注册的钥匙的标记面与电源/发动机开关接触。",
	"326621FC4F43": "步骤2（共3步）\\n\\n请将需要进行注册的钥匙移动到副座上。",
