	"326621FC4F45": "注册情况",
	"326621FC4F46": "可注册钥匙数量",
	"326621FC4F47": "请用已完成注册的钥匙与电源/发动机开关接触进行配对。\\n\\n< 注意 >\\n请用已完成注册的钥匙的标记面与电源/发动机开关接触。",
	"326621FC4F48": "最后配对的钥匙尚未注册。\\n其他已完成配对的钥匙已经完成注册。\\n请确认目前已完成注册钥匙的数量。\\n\\n需要对未完成注册的钥匙进行注册的情况\\n请按压“确定”按钮，需要结束操作的情况\\n请按压'结束'按钮。",
