	"326621FC4FD0": "燃油PCV补偿值重置错误",
	"326621FC4FD1": "燃油PCV补偿值重置已失败。\\n请检查以下条件是否满足。\\n- 打开发动机/电源开关（发动机停止/“准备就绪”指示灯熄灭）。\\n\\n请参考维修手册获取详情。\\n是否再试一次？",
	"326621FC4FD2": "执行以下操作然后按“确定”。\\n\\n- 关闭发动机/电源开关。",
	"326621FC4FD3": "燃油PCV补偿值重置已完成。\\n\\n进行以下操作。\\n- 打开发动机/电源开关（发动机停止/“准备就绪”指示灯熄灭）。",
	"326621FC4FD4": "此功能可转入控制模式。\\n确认以下条件是否满足。\\n-打开发动机/电源开关（发动机停止/“准备就绪”指示灯熄灭）。\\n-车辆已停止。\\n\\n按“确定”进入控制模式。",
