	"326621FC4FD8": "控制模式已完成。\\n\\n提示\\n请执行以下步骤退出控制模式。\\n1. 关闭发动机/电源开关。\\n2. 打开发动机/电源开关（发动机停止/“准备就绪”指示灯熄灭）。",
	"326621FC4FD9": "保存日期",
