	"326621FD4C76": "此功能可更新保存在ECU内的电池状态信息。\\n确认以下条件是否满足：\\n-无混动/电动车相关的故障码。\\n按【确定】开始更新。",
	"326621FD4C77": "正在更新中……\\n电池状态信息更新结束后，界面将发生变化。\\n（大约11分钟后才能完成更新）。\\n进度",
	"326621FD4C78": "<警告>更新过程中切勿将点火开关转至“关闭”位置。",
	"326621FD4C79": "现已准备就绪，待更新。\\n完成以下操作，再按【确定】。\\n1. 将点火开关转至“关闭”位置； \\n2. 等待10秒；\\n3. 再将点火开关转至“打开”位置。",
	"326621FD4C7A": "电池状态信息更新已完成。\\n关闭发动机/电源开关，然后再打开（发动机停止/准备就绪指示灯熄灭）。",
	"326621FD4C7B": "电池状态信息更新已失败。\\n请参考维修手册获取详情。\\n是否再试一次？",
	"326621FD4C7C": "电池状态信息更新已失败。\\n确认以下条件是否满足：\\n- 无混动/电动车相关的故障码。\\n是否再试一次？",
	"326621FD4C7E": "车辆信息同步",
	"326621FD4C7F": "此功能用于检查防滑控制ECU内保存的车辆信息是否符合实际情况。\\n\\n确认以下条件是否满足。\\n-已挂入驻车挡；\\n-拉起手刹；\\n-车辆停止；\\n-发动机停止/准备就绪指示灯熄灭；\\n-点火开关已转至“打开”位置；\\n-电池电压正常。\\n按【确定】继续。",
	"326621FD4C80": "正在获取车辆信息。\\n请稍候。",
