	"326621FD4C97": "预热控制单元检查",
	"326621FD4C98": "此功能用于检查预热控制单元（GCU），必要的话还可激活预热控制单元。\\n发动机难以启动时，可执行此功能。\\n使用此功能时请参考维修手册。\\n\\n确认以下条件是否满足：\\n-打开发动机/电源开关（发动机停止/准备就绪指示灯熄灭）\\n按【确定】开始检查。",
	"326621FD4C99": "检查预热控制单元状态，\\n请稍等待。",
