	"326621FD6CA3": "欢迎来到“ECU通信ID注册”向导。\\n该功能用于执行“握手”程序。\\n确认满足以下条件：\\n-电源/发动机开关打开（点火开关打开）。\\n-“无钥匙进入&启动”功能关闭。",
