	"326621FD6CAF": "“ECU通信ID注册”执行失败。\\n确定以下条件是否满足：\\n- 发动机/电源开关已打开（发动机熄火/准备就绪指示灯熄灭）。\\n是否重试？",
	"326621FD6CB0": "使用一把已注册钥匙触碰发动机开关。\\n<注意>\\n确保车标侧面向发动机开关。\\n剩余时间：",
