	"326621FD6CCD": "确认满足以下条件。\\n-任意车门打开。\\n-车辆电源“全部关闭”。\\n该功能现将对已注册钥匙进行检查。\\n完成已注册钥匙的准备后，按下【确定】继续。",
	"326621FD6CCE": "该功能将检查已注册的钥匙。\\n执行以下操作。\\n将注册的主钥匙或卡片钥匙触碰发动机开关。\\n\\n正在确认已注册钥匙\\n剩余时间",
