	"326621FD6DF6": "欢迎使用“钥匙编号注册”向导，将钥匙编号注册至ECU。\\n确保在更换新的防盗系统ECU时执行该操作（用于将车辆ID注册至ECU）。\\n\\n按【确定】继续。",
	"326621FD6DF7": "步骤1（共3步）\\n\\n检查初始条件，然后按【确定】。\\n\\n-驾驶员侧车门打开。\\n   或\\n-点火开关在ON位置。",
