	"326621FD6DFD": "“钥匙编号注册”执行失败。\\n无法解除安全装置。\\n是否重试？",
	"326621FD6DFE": "“钥匙编号注册”执行失败。\\n是否重试？",
	"326621FD6F01": "“制动系统排气”执行失败。\\n\\n确认满足以下条件。\\n-发动机/电源开关打开（发动机熄火/准备就绪指示灯关闭）。\\n-电池电压正常。\\n-已拉起驻车制动器。\\n-换挡杆在驻车档（P）。\\n\\n是否重试？",
	"326621FD6F02": "“制动系统排气”出错",
	"326621FD6F03": "警告：\\n-请勿松开驻车制动器。\\n-请勿将换挡杆移动到P以外的位置。\\n\\n现在正在执行线性管排气。\\n\\n运行时间：",
