	"326621FD6F18": "“TPMS操作历史”出错",
	"326621FD6F19": "无效",
	"326621FD6F1A": "确定",
	"326621FD6F1B": "无法开始注册模式。\\n失败的可能原因如下：\\n-发动机或电源开关关闭。\\n-车辆电池电压低。\\n-车辆通信失败。\\n\\n是否重试？",
	"326621FD6F1C": "用已注册的钥匙接触发动机开关。<钥匙检查>\\n\\n用已注册的钥匙接触发动机开关。\\n\\n确定钥匙码数字。\\n待重新注册的钥匙数量",
	"326621FD6F1D": "时间限制：30秒。\\n按【启动前检查】按钮开始注册流程。在规定时间内执行以下步骤。\\n步骤1.\\n将先前ECU钥匙放进车辆。\\n步骤2.\\n使用钥匙接触发动机开关。（发出蜂鸣声）\\n步骤3.\\n从车辆上移除钥匙。",
	"326621FD6F1E": "智能ECU更换：标准型\\n智能ECU更换后，如需注册一把新智能钥匙，请按以下步骤操作。\\n按以下步骤操作，将智能ECU更换前已注册好的钥匙重新注册。\\n1. 确保按步骤1到3操作结束后，智能ECU能够识别出已注册钥匙的数量。\\n2. 按步骤4到7，将已注册的钥匙重新注册到智能ECU内。如需注册其他新钥匙，此模式结束时按【确定】启动其他钥匙注册模式。\\n步骤1\\n将智能ECU更换前已注册的钥匙带入车内。\\n步骤2\\n将智能ECU更换前已注册的钥匙的品牌标识侧，对着发动机/电源开关按下，以核实该把钥匙。如车辆识别出此把钥匙，就会发生一声蜂鸣声。未接触发动机/电源开关进行识别的钥匙，进入步骤3。\\n如果所有钥匙均已接触发动机/电源开关完成识别，进入步骤4。\\n步骤3\\n将已接触发动机/电源开关进行识别的钥匙带出车外。\\n步骤4\\n将已接触发动机/电源开关进行识别的钥匙放置在乘客座椅上完成注册。未接触发动机/电源开关进行识别的钥匙，进入步骤5。如果所有钥匙均已接触发动机/电源开关完成识别，进入步骤8。\\n步骤5\\n将已注册的钥匙带出车外。\\n步骤6\\n将尚未接触发动机/电源开关进行识别的钥匙带入车内。\\n步骤7\\n将尚未接触发动机/电源开关进行识别的钥匙的品牌标识面，对着发动机/电源开关按下，如车辆识别出该钥匙，将发生一声蜂鸣声。进入步骤4。\\n步骤8\\n注册完成界面出现时，表示注册已完成。以上是注册流程的详细说明，请关闭窗口，回到功能界面，按【开始】。",
	"326621FD6F1F": "秒。按【开始】按钮开始注册过程。\\n在规定时间内执行以下步骤。\\n\\n步骤1.\\n将先前ECU钥匙放进车辆。\\n步骤2.\\n使用钥匙接触发动机开关。（发出蜂鸣声）\\n步骤3.\\n从车辆上移除钥匙。",
	"326621FD6F20": "用已注册的钥匙接触发动机开关。<注册>\\n用已注册的钥匙接触发动机开关。\\n确定钥匙代码数量。\\n\\n要重新注册的钥匙数量",
	"326621FD6F21": "在规定时间内完成以下步骤。\\n\\n时间限制：",
	"326621FD6F22": "秒。\\n步骤1.  将待重新注册的钥匙带入车内。\\n步骤2.  将该钥匙接触发动机开关。（发出蜂鸣声）。",
