	"326621FD6F41": "“视频设备连接检查”已结束，\\n未检测到任何故障，但无法检查后座娱乐系统，因为前排座椅的DVD/蓝光光碟播放器内未插入任何DVD/蓝光光碟。\\n将DVD/蓝光光碟插入前排座椅的DVD/蓝光光碟播放器后，再尝试检查后座娱乐系统的连接情况。",
	"326621FD6F42": "无法检查后座娱乐系统，因为前排座椅的DVD/蓝光光碟播放器内未插入任何DVD/蓝光光碟。\\n\\n将DVD/蓝光光碟插入前排座椅的DVD/蓝光光碟播放器后，再尝试检查后座娱乐系统的连接情况。",
