	"326621FD6F8C": "该功能用于对高压电池ECU进行初始化。\\n在以下情况使用该功能。\\n-更换高压电池总成时。",
	"326621FD6F8D": "电池ECU初始化准备工作已完成。\\n关闭发动机/电源开关，然后按下【确定】继续。",
	"326621FD6F8E": "当剩余时间变成0秒时，打开发动机/电源开关（发动机停止/准备就绪指示灯熄灭），然后按下【退出】键完成初始化。",
	"326621FD6F8F": "是否退出“电池ECU初始化”功能？",
	"326621FD6F90": "取消高压电池低电压就绪指示灯点亮（READY ON）禁止",
	"326621FD6F91": "该功能用于，当电池电压低而导致准备就绪指示灯点亮被禁止时，取消该禁止状态。\\n【警告】\\n确保在执行此功能前先进行诊断和维修。\\n否则可能会导致发生火灾。\\n\\n按【确定】取消“准备就绪指示灯点亮禁止状态”。\\n\\n- 我同意这些条件。",
	"326621FD6F92": "“取消高压电池低电压就绪指示灯点亮禁止”已完成。\\n提示：\\n故障码尚未清除。请务必在退出该功能后检查故障码。",
	"326621FD6F93": "是否退出“取消高压电池低电压就绪指示灯点亮禁止”功能？",
	"326621FD6FA0": "零件更换",
	"326621FD6FA1": "拆卸或安装多模式手动变速器系统相关的零件时使用该功能。\\n查看维修手册中零件的详细信息。\\n按【确定】继续。",
	"326621FD6FA2": "是否退出“零件更换”功能？",
	"326621FD6FA3": "确认以下条件是否满足：\\n-发动机停止运行；\\n-点火开关处于ON位置；\\n-变速杆在空档位置。\\n-未检测到故障码P0820或P0725或U0100；\\n- 电池电压超过8伏。\\n按【确定】继续。",
	"326621FD6FA4": "维修手册中提示需要更换零件时，按下一界面所显示的3个步骤操作。",
	"326621FD6FA5": "步骤1：拆除零件之前，选择下一界面所显示的“步骤1 选择离合器位置”，移动离合器位置。\\n步骤2：更换零件。\\n步骤3：选择下一界面所显示的“步骤3 初始化和学习”，准备进行初始学习。\\n\\n按【确定】继续。",
	"326621FD6FA6": "选择合适的选项，再按【确定】继续。\\n注意：如需再次使用离合器执行器总成时，确保先进行离合器位置调节，再安装离合器执行器总成。",
	"326621FD6FA7": "步骤1 零件更换准备工作",
	"326621FD6FA8": "步骤3 初始化和学习",
	"326621FD6FA9": "选择待更换、拆除和安装的相应零件，\\n再按【确定】继续。",
