	"326621FD6FB6": "曲轴",
	"326621FD6FB7": "零件更换准备工作警告：如果上一界面所选择的零件均已更换，则需要更换离合器盘和盖。\\n确保离合器盘和盖是按照维修手册的指示进行更换的。",
	"326621FD6FB8": "零件更换准备工作\\n将离合器移至未安装位置，\\n确认以下条件是否满足：\\n-发动机停止运行；\\n-点火开关处于ON位置；\\n-变速杆在空档位置。\\n-未检测到故障码P0820或P0725或U0100；\\n- 电池电压超过8伏。",
	"326621FD6FB9": "离合器位置调节\\n确认离合器已停止发出操作噪音，离合器的位置已移动。\\n进入步骤2，更换零件，再进入步骤3，选择“步骤3 初始化和学习”准备初始学习。",
	"326621FD6FBA": "初始化和学习\\n警告：如果上一界面所选择的零件均已更换，则需要更换离合器盘和盖。\\n按【后退】回到零件选择界面，\\n按【确定】回到相应界面，再更换零件。",
	"326621FD6FBB": "初始化和学习\\n按界面指示操作，进行初始化和学习，\\n按【确定】继续。",
	"326621FD6FBC": "关闭点火开关，按“确定”初始化已存储信息。",
	"326621FD6FBD": "然后，执行初始学习以确保初始化的变速器控制ECU记住调整过的离合器位置或档位位置。\\n转动点火开关至ON，然后按【确定】继续。",
	"326621FD6FBE": "正在学习",
	"326621FD6FBF": "关闭点火开关，按【确定】初始化已存储信息。",
	"326621FD6FC0": "换挡杆处于空挡位置时踩下制动踏板，\\n启动发动机，按【确定】继续。",
	"326621FD6FC1": "“零件更换”已完成。\\n按【退出】退出此功能。",
	"326621FD6FC2": "“离合器位置调节零件更换”已失败，\\n确认以下条件是否满足：\\n-发动机停止运行；\\n-点火开关处于ON位置；\\n-变速杆在空档位置。\\n-未检测到故障码P0820或P0725或U0100；\\n- 电池电压超过8伏。\\n是否再试一次？",
	"326621FE4C00": "将钥匙从锁芯移除，再次插入钥匙然后打开点火开关（发动机关闭）。",
	"326621FE4C01": "返回",
	"326621FE4C02": "退出",
	"326621FE4C03": "无法启动钥匙注册。\\n是否重试？",
	"326621FE4C04": "“钥匙注册”\\n将待注册钥匙插入锁芯。\\n<警告>\\n“钥匙注册”完成之前请勿移除钥匙。",
	"326621FE4C05": "“钥匙注册”失败。\\n确认满足以下条件：\\n-插入钥匙是待注册钥匙。\\n是否重试？",
	"326621FE4C06": "最后所插入的钥匙未成功注册。\\n之前所插入的其他钥匙已成功注册。\\n确认现有已注册钥匙数。\\n按“确定”继续注册其他钥匙编码。",
	"326621FE4C07": "“钥匙注册”失败\\n钥匙注册完成。\\n无更多钥匙空间。\\n若要注册新钥匙，使用“钥匙编码清除”以清除钥匙编码。\\n按“退出”继续。",
	"326621FE4C08": "钥匙已注册。\\n可注册新钥匙编码的空间数量：\\n“主钥匙”",
	"326621FE4C09": "移除该钥匙以注册其他钥匙或按“确定”结束钥匙注册。",
	"326621FE4C0A": "钥匙注册完成。\\n可注册新钥匙编码的空间数量：\\n“主钥匙”",
	"326621FE4C0B": "按“确定”注册其他钥匙。",
	"326621FE4C0C": "“钥匙注册”\\n注册正在进行\\n将钥匙从锁芯移除。\\n剩余时间：",
	"326621FE4C0D": "欢迎使用“应答器编码注册”向导，将钥匙注册到ECU。\\n提示：\\n如果每一步都超时，注册将会失败。",
	"326621FE4C0E": "步骤1（共10步）\\n在锁芯中插入一把已注册的主钥匙并打开点火开关。\\n\\n然后按“确定”继续。",
	"326621FE4C0F": "选择新钥匙预定类型",
	"326621FE4C10": "主钥匙",
