	"326621FE4C12": "步骤2（共10步）\\n新钥匙将被注册为\\n主钥匙\\n按“确定”继续。",
	"326621FE4C13": "步骤3（共10步）\\n“主钥匙”\\n从锁芯中移除主钥匙，再次插入并在120秒内打开点火开关，然后按“确定”。\\n剩余时间：",
	"326621FE4C14": "“应答器编号注册”失败。\\n步骤超时。\\n是否重试？",
	"326621FE4C15": "步骤4（共10步）\\n“主钥匙”\\n在20秒内将主钥匙从锁芯移除，然后立刻按“确定”。\\n\\n剩余时间：",
	"326621FE4C16": "步骤5（共10步）\\n“主钥匙”\\n在7秒内将新钥匙插入锁芯。\\n然后按“确定”\\n\\n剩余时间：",
	"326621FE4C17": "步骤6（共10步）\\n“主钥匙”\\n现在正在注册\\n\\n剩余时间：",
	"326621FE4C18": "步骤7（共10步）\\n“主钥匙”\\n从锁芯中移除该钥匙，插入一把已注册的主钥匙并在120秒内打开点火开关，然后按“确定”。\\n剩余时间：",
	"326621FE4C19": "步骤8（共10步）\\n“主钥匙”\\n在20秒内将主钥匙从锁芯移除，然后按“确定”。\\n\\n剩余时间：",
	"326621FE4C1A": "步骤9（共10步）\\n“主钥匙”\\n在10秒内将新钥匙插入锁芯，然后按“确定”。\\n\\n剩余时间：",
	"326621FE4C1B": "“主钥匙” \\n“应答器编码注册”失败。\\n注册已满。\\n先执行“钥匙编码清除”\\n然后进行“应答器编码注册”\\n是否重试？",
	"326621FE4C1C": "步骤10（共10步）\\n主钥匙\\n现在正在注册\\n剩余时间：",
	"326621FE4C1D": "“主钥匙”\\n“应答器编码注册”完成。\\n请使用该钥匙启动发动机。\\n如果发动机启动，“应答器编码注册”成功。",
	"326621FE4C1E": "“主钥匙”\\n将主钥匙插入锁芯并打开点火开关。\\n如果点火开关已打开，则先关闭然后再打开。\\n按“确定”注册其他钥匙，或按“取消”退出该功能。",
	"326621FE4C1F": "“主钥匙”\\n新钥匙可能已经注册。\\n请使用该钥匙启动发动机。\\n如果发动机启动，“应答器编码注册”成功。",
	"326621FE4C20": "“主钥匙”\\n将主钥匙插入锁芯并打开点火开关。\\n如果点火开关已打开，则先关闭然后再打开。",
	"326621FE4C21": "步骤2（共10步）\\n新钥匙将被注册为\\n子钥匙\\n按“确定”继续。",
	"326621FE4C22": "步骤3（共10步）\\n“子钥匙”\\n从锁芯中移除主钥匙，再次插入并在120秒内打开点火开关，然后按“确定”。\\n剩余时间：",
	"326621FE4C23": "步骤4（共10步）\\n“子钥匙”\\n在20秒内将主钥匙从锁芯移除，然后立刻按“确定”。\\n\\n剩余时间：",
	"326621FE4C24": "步骤5（共10步）\\n“子钥匙”\\n在7秒内将新钥匙插入锁芯。\\n然后按“确定”\\n\\n剩余时间：",
	"326621FE4C25": "步骤6（共10步）\\n“子钥匙”\\n现在正在注册\\n\\n剩余时间：",
	"326621FE4C26": "步骤7（共10步）\\n“子钥匙”\\n从锁芯中移除该钥匙，插入一把已注册的主钥匙并在120秒内打开点火开关，然后按“确定”。\\n剩余时间：",
	"326621FE4C27": "步骤8（共10步）\\n“子钥匙”\\n在20秒内将主钥匙从锁芯移除，然后按“确定”。\\n\\n剩余时间：",
	"326621FE4C28": "步骤9（共10步）\\n“子钥匙”\\n在10秒内将新钥匙插入锁芯。\\n然后按“确定”\\n\\n剩余时间：",
	"326621FE4C29": "“子钥匙” \\n“应答器编码注册”失败。\\n注册已满。\\n先执行“钥匙编码清除”\\n然后进行“应答器编码注册”\\n是否重试？",
