	"326621FE4DDD": "普通排气\\nRR车轮\\n1.将点火开关设为0FF。\\n2.拆掉两个ABS电机继电器。\\n参考：\\n已经拆掉ABS电机继电器的情况则不需要进行步骤二。 \\n3.将点火开关设为ON。",
