	"326621FE4DE4": "普通排气\\n 全车轮\\n1.用塑料软管与FL车轮的排气塞连接。\\n2.踩踏制动踏板数次之后，\\n在踏住制动踏板的状态下 \\n \\n松掉排气塞。\\n3.当制动液不再流动时，\\n拧紧排气塞，松开制动踏板。\\n请重复实施步骤1～3直至空气完全排光为止\\n。 \\n请按压'OK'按钮。",
	"326621FE4DE5": "普通排气\\n 全车轮\\n１．用塑料软管与RL车轮的排气塞连接\\n２．踩踏制动踏板。\\n３．在踏住制动踏板的状态下松掉RR车轮的排气塞。\\n４．请重复实施直至空气完全排光。\\n排气完毕后，拧紧排气塞，松开制动踏板。\\n请按压'OK'按钮。",
	"326621FE4DE6": "普通排气\\n 全部车轮\\n１．用塑料软管与RR车轮的排气塞连接\\n２．踩踏制动踏板。\\n３．在踏住制动踏板的状态下松掉RL车轮的排气塞。\\n４．请重复实施直至空气完全排光。\\n排气完毕后，拧紧排气塞，松开制动踏板。\\n请按压'OK'按钮。",
	"326621FE4DE7": "普通排气\\n 全部车轮\\n排气完毕。\\n需要实施其他排气操作的情况\\n请按压'OK'按钮，需要结束操作的情况，\\n请按压'ESC'按钮。",
	"326621FE4DE8": "应答器编码注册",
	"326621FE4DE9": "欢迎使用“应答器编码注册”向导。\\n此功能用于注册防盗器钥匙。\\n注意：如果任一步骤超时，“应答器编码注册”将会失败。\\n按“确定”继续。",
	"326621FE4DEA": "是否退出“应答器编码注册”？",
	"326621FE4DEB": "步骤1（共3步）\\n执行以下操作：\\n-从钥匙插槽中移除钥匙。\\n-将钥匙插回钥匙插槽。\\n-打开点火。",
	"326621FE4DEC": "剩余时间:",
	"326621FE4DED": "秒",
	"326621FE4DEF": "“应答器编号注册”失败。\\n步骤超时。\\n是否重试？",
	"326621FE4DF0": "步骤2（共3步）\\n在20秒内将主钥匙从钥匙插槽移除，然后按“确定”。",
	"326621FE4DF1": "步骤3（共3步）\\n在10秒内将想要注册的钥匙插入钥匙插槽\\n<注意>\\请勿打开电源/发动机开关（点火）。",
	"326621FE4DF2": "应答器编码注册失败.\\n此钥匙已注册.",
	"326621FE4DF3": "正在注册",
	"326621FE4DF4": "应答器码登记错误",
	"326621FE4DF5": "将已注册的钥匙插入钥匙插槽并打开电源/发动机开关（点火）。\\n如果电源/发动机开关已打开（点火），请关闭电源/发动机开关然后再打开（点火）。",
	"326621FE4DF6": "“应答器编码注册”失败。\\n钥匙和应答器编码ECU之间发生通信错误。",
	"326621FE4DF7": "是否重试？",
	"326621FE4DF8": "子钥匙\\n“应答器编码注册”成功。\\n请使用该钥匙启动发动机。\\n如果发动机启动，“应答器编码注册”成功。",
	"326621FE4DF9": "主钥匙\\n“应答器编码注册”成功。\\n请使用该钥匙启动发动机。\\n如果发动机启动，“应答器编码注册”成功。",
	"326621FE4DFA": "插入一把已注册的钥匙并打开电源/发动机开关（点火）。\\n如果电源/发动机开关已打开（点火），请先关闭然后再打开。\\n请按“确定”注册另一钥匙或按“取消”退出该功能。",
	"326621FE4DFB": "此功能用于注册防盗器钥匙。\\n确认插入的钥匙是主钥匙。\\n按“确定”继续。",
	"326621FE4DFC": "“钥匙注册”失败。\\n无更多钥匙空间。\\n若要注册新钥匙，使用“钥匙编码清除”以清除钥匙编码。",
