	"327B21FEF751": "本 ECU 控制顶灯等车内照明、车门灯、刮水器系统、照明系统和肩部安全带马达。",
	"327B21FEF752": "此系统控制以最佳速度巡航并监测车辆与其他物件之间的距离避免碰撞。",
	"327B21FEF753": "此ECU控制EV/FC系统的全部功能（电源控制单元，电池组和插入/EV外部电源系统）。",
	"327B21FEF754": "此系统控制以最佳速度巡航并监测车辆与其他物件之间的距离避免碰撞。",
	"327B21FEF755": "此ECU包含以下2项功能。\\n【间隔声纳】\\n此功能检测车辆周围的障碍物并提醒驾驶员。\\n\\n\\n【简单-IPA】\\n此功能自动控制方向盘，使车辆平行停泊或轻松停入车库。",
	"327B21FEF756": "本 ECU 控制燃油喷射、点火正时、爆震控制、怠速发动机转速、自诊断功能以及在特别环境下的备用功能等。",
	"327B21FEF757": "此ECU控制变速器。",
	"327B21FEF758": "本系统自动控制设定车速巡航并通过发动机 ECU 执行。",
	"327B21FEF759": "此ECU控制后轮扭矩矢量差。",
	"327B21FEF75A": "此ECU控制拖车上的制动器。",
	"327B21FEF75B": "【PCS：预碰撞安全系统】\\n当车辆前方即将与物体发生碰撞时，此功能有助于减轻或避免碰撞。\\n\\n\\n【LDA：车道偏离警告】\\n此功能通过蜂鸣器提醒驾驶员车辆可能偏离车道。\\n\\n\\n【RSA：路标辅助】\\n此功能识别路标并通过多信息显示屏向驾驶员提供信息。\\n\\n\\n【LVN : 引导车辆移动提示】\\n此功能通过蜂鸣器和仪表显示器提示驾驶员引导车辆移动。",
	"327B21FEF75C": "此ECU接收多信息显示和车辆状态请求，如车门打开/关闭，点火打开/关闭等，来控制车顶照明。",
	"327B21FEF75D": "此ECU记录用于车辆故障时的诊断的有用信息。",
	"327B21FEF75E": "该ECU控制冷却和燃料电池的功能,如氢气或空气供应。",
	"327B21FEF75F": "此ECU控制燃料电池组的电压增压器功能。",
	"327B21FEF760": "此ECU控制与FC外部电源相关的功能（例如，供电设备）。",
	"327B21FEF761": "此系统进行网络间的数据传递。",
	"327B21FEF762": "此ECU包含以下任一功能。\\n当检测到车辆偏离车道时，两项功能均会启动。\\n\\n\\n【LKA：车道保持辅助】\\n-此功能使用蜂鸣器提醒驾驶员车辆可能偏离车道。\\n-此功能控制方向盘以辅助保持车道。\\n\\n\\n【LDA：车道偏离警告】\\n-此功能使用蜂鸣器提醒驾驶员车辆可能偏离车道。",
	"327B21FEF763": "此ECU控制摄像头，识别车辆前方情况。",
	"327B21FEF764": "此ECU识别路标并通过多信息显示屏为驾驶员提供信息。",
	"327B21FEF765": "此ECU在驻车时显示车辆周围环境，帮助驾驶员轻松停车。",
	"327B21FEF766": "此ECU控制防抱死制动系统，车辆稳定性控制，电子驻车制动和制动系统，控制车辆安全性能。",
	"327B21FEF767": "此ECU包含以下3项功能。\\n【间隔声纳】\\n此功能检测车辆周围的障碍物并提醒驾驶员。\\n\\n\\n【ICS】\\n此功能检测与目标物体之间的距离，并调整加速踏板失步。\\n\\n\\n【简单-IPA】\\n此功能自动控制方向盘，使车辆平行停泊或轻松停入车库。",
	"327B21FEF768": "此ECU控制雨刮器。",
	"327B21FEF769": "此ECU控制抬头显示器。",
	"327B21FEF76A": "此ECU控制占座检测传感器。\\n占座检测传感器检测乘客的体型信息。",
	"327B21FEF76B": "此ECU控制左侧滑动门。",
	"327B21FEF76C": "此ECU控制用于驱动两部电机的电源转换装置和电压转换设备。",
	"327B21FEF76D": "本 ECU 根据加速踏板开度、换挡杆位置等信息计算发动机输出、马达驱动扭矩和发电机驱动扭矩来控制混合动力车辆的驱动力。",
	"327B21FEF76E": "本 ECU 根据蓄电池温度控制鼓风机马达并根据蓄电池电压、蓄电池温度和电流传感器计算充电状态。此外,还将充电状态发送至 HV ECU。",
	"327B21FEF76F": "此ECU控制无线车门锁和安全系统，还控制车顶灯，车内灯，电动车窗和后视镜的内部照明。此ECU从工具或其他ECU处转接信号，并检测它们之间的通信故障。",
	"327B21FEF770": "此ECU从工具或其他ECU处转接信号，并检测它们之间的通信故障。",
	"327B21FEF771": "EC车辆上配置有燃料电池组和混合动力电池。\\n此ECU控制从燃料电池组和混合动力电池输出的电量。",
	"327B21FEF772": "此ECU控制驻车辅助监测器，此监测器在车辆倒车时显示车辆后部情况。",
	"327B21FEF773": "本 ECU 组合车身系统和网关系统并对其进行控制。",
	"327B21FEF774": "本 ECU 控制无钥匙进入和起动发动机。通过对比 ID 代码和车辆已注册的代码确定是否禁止起动发动机。",
	"327B21FEF775": "本 ECU 控制导航系统。",
	"327B21FEF776": "此ECU控制悬架。",
	"327B21FEF777": "此ECU控制无线车门锁和安全系统，还控制车顶灯，车内灯，电动车窗和后视镜的内部照明。此ECU从工具或其他ECU处转接信号，并检测它们之间的通信故障。",
	"327B21FEF778": "此ECU控制电驱手动变速器。",
	"327B21FEF779": "此ECU控制车辆与移动设备之间的蓝牙通信。",
	"327B21FEF77A": "此ECU在驻车时显示车辆周围环境，帮助驾驶员轻松停车。",
	"327B21FEF77B": "此ECU包含以下3项功能。\\n【间隔声纳】\\n此功能检测车辆周围的障碍物并提醒驾驶员。\\n\\n\\n【ICS】\\n此功能检测与目标物体之间的距离，并调整加速踏板失步。\\n\\n\\n【简单-IPA】\\n此功能自动控制方向盘，使车辆平行停泊或轻松停入车库。",
	"327B21FEF77C": "【PCS：预碰撞安全系统】\\n当车辆前方即将与物体发生碰撞时，此功能有助于减轻或避免碰撞。\\n\\n\\n【LDA：车道偏离警告】\\n此功能通过蜂鸣器提醒驾驶员车辆可能偏离车道。\\n\\n\\n【RSA：路标辅助】\\n此功能识别路标并通过多信息显示屏向驾驶员提供信息。\\n\\n\\n【LVN : 引导车辆移动提示】\\n此功能通过蜂鸣器和仪表显示器提示驾驶员引导车辆移动。",
	"327B21FEF77D": "此ECU控制摄像头，识别车辆前方情况。",
	"327B21FEF77E": "此ECU控制车辆与道路通信和车辆之间的通信。",
	"327B21FEF77F": "此ECU控制用于驱动后置电机的电源转换装置。",
	"327B21FEF780": "此ECU控制防抱死制动系统，车辆稳定性控制，电子驻车制动和制动系统，控制车辆安全性能。",
	"327B21FEF781": "此ECU包含以下3项功能。\\n【直观P/A】\\n此功能检测车辆周围的障碍物并提醒驾驶员。\\n\\n\\n【ICS】\\n此功能检测与目标物体之间的距离，并调整加速踏板失步。\\n\\n\\n【高级停车导引】\\n此功能自动控制方向盘，使车辆平行停泊或轻松停入车库。",
